shown in listing pages','','none'),(4036,'','default','Requires a correctly configured <a href=\"@cron\">cron maintenance task</a>.','','none'),(4037,'','default','Select categories using','','none'),(4038,'','default','For a small number of categories, checkboxes are easier to use, while a multiple selector works well with large numbers of categories.','','none'),(4039,'','default','Length of trimmed description','','none'),(4040,'','default','The maximum number of characters used in the trimmed version of content.','','none'),(4041,'','default','The Aggregator module is an on-site syndicator and news reader that gathers and displays fresh content from RSS-, RDF-, and Atom-based feeds made available across the web. Thousands of sites (particularly news sites and blogs) publish their latest headlines in feeds, using a number of standardized XML-based formats. For more information, see the online handbook entry for <a href=\"@aggregator-module\">Aggregator module</a>.','','none'),(4042,'','default','Viewing feeds','','none'),(4043,'','default','Feeds contain published content, and may be grouped in categories, generally by topic. Users view feed content in the <a href=\"@aggregator\">main aggregator display</a>, or by <a href=\"@aggregator-sources\">their source</a> (usually via an RSS feed reader). The most recent content in a feed or category can be displayed as a block through the <a href=\"@admin-block\">Blocks administration page</a>.','','none'),(4044,'','default','Adding, editing, and deleting feeds','','none'),(4045,'','default','Administrators can add, edit, and delete feeds, and choose how often to check each feed for newly updated items on the <a href=\"@feededit\">Feed aggregator administration page</a>.','','none'),(4046,'','default','OPML integration','','none'),(4047,'','default','A <a href=\"@aggregator-opml\">machine-readable OPML file</a> of all feeds is available. OPML is an XML-based file format used to share outline-structured information such as a list of RSS feeds. Feeds can also be <a href=\"@import-opml\">imported via an OPML file</a>.','','none'),(4048,'','default','Configuring cron','','none'),(4049,'','default','A correctly configured <a href=\"@cron\">cron maintenance task</a> is required to update feeds automatically.','','none'),(4050,'','default','<acronym title=\"Outline Processor Markup Language\">OPML</acronym> is an XML format used to exchange multiple feeds between aggregators. A single OPML document may contain a collection of many feeds. Drupal can parse such a file and import all feeds at once, saving you the effort of adding them manually. You may either upload a local file from your computer or enter a URL where Drupal can download it.','','none'),(4051,'','default','Administer news feeds','','none'),(4052,'','default','View news feeds','','none'),(4053,'','default','Configure the behavior of the feed aggregator, including when to discard feed items and how to present feed items and categories.','','none'),(4054,'','default','Override the default title for the block. Use <em>!placeholder</em> to display no title, or leave blank to use the default block title.','','7.16'),(4055,'','default','Specify in which themes and regions this block is displayed.','','7.16'),(4056,'','default','All pages except those listed','','7.16'),(4057,'','default','Only the listed pages','','7.16'),(4058,'','default','Specify pages by using their paths. Enter one path per line. The \'*\' character is a wildcard. Example paths are %blog for the blog page and %blog-wildcard for every personal blog. %front is the front page.','','7.16'),(4059,'','default','Pages on which this PHP code returns <code>TRUE</code> (experts only)','','none'),(4060,'','default','Pages or PHP code','','none'),(4061,'','default','If the PHP option is chosen, enter PHP code between %php. Note that executing incorrect PHP code can break your Drupal site.','','none'),(4062,'','default','Customizable per user','','7.16'),(4063,'; modules/block/block.js','default','Not customizable','','7.16'),(4064,'','default','Customizable, visible by default','','7.16'),(4065,'','default','Customizable, hidden by default','','7.16'),(4066,'','default','Ensure that each block description is unique.','','none'),(4067,'','default','The Block module allows you to create boxes of content, which are rendered into an area, or region, of one or more pages of a website. The core Seven administration theme, for example, implements the regions \"Content\", \"Help\", \"Dashboard main\", and \"Dashboard sidebar\", and a block may appear in any one of these regions. The <a href=\"@blocks\">Blocks administration page</a> provides a drag-and-drop interface for assigning a block to a region, and for controlling the order of blocks within regions. For more information, see the online handbook entry for <a href=\"@block\">Block module</a>.','','7.16'),(4068,'','default','Positioning content','','7.16'),(4069,'','default','When working with blocks, remember that all themes do <em>not</em> implement the same regions, or display regions in the same way. Blocks are positioned on a per-theme basis. Users with the <em>Administer blocks</em> permission can disable blocks. Disabled blocks are listed on the <a href=\"@blocks\">Blocks administration page</a>, but are not displayed in any region.','','7.16'),(4070,'','default','Controlling visibility','','7.16'),(4071,'','default','Blocks can be configured to be visible only on certain pages, only to users of certain roles, or only on pages displaying certain <a href=\"@content-type\">content types</a>. Administrators can also allow specific blocks to be enabled or disabled by users when they edit their <a href=\"@user\">My account</a> page. Some dynamic blocks, such as those generated by modules, will be displayed only on certain pages.','','7.16'),(4072,'','default','Creating custom blocks','','7.16'),(4073,'','default','Users with the <em>Administer blocks</em> permission can <a href=\"@block-add\">add custom blocks</a>, which are then listed on the <a href=\"@blocks\">Blocks administration page</a>. Once created, custom blocks behave just like default and module-generated blocks.','','7.16'),(4074,'','default','This page provides a drag-and-drop interface for assigning a block to a region, and for controlling the order of blocks within regions. Since not all themes implement the same regions, or display regions in the same way, blocks are positioned on a per-theme basis. Remember that your changes will not be saved until you click the <em>Save blocks</em> button at the bottom of the page. Click the <em>configure</em> link next to each block to configure its specific title and visibility settings.','','7.16'),(4075,'','default','Demonstrate block regions (@theme)','','7.16'),(4076,'','default','Administer blocks','','7.16'),(4077,'','default','A brief description of your block. Used on the <a href=\"@overview\">Blocks administration page</a>.','','7.16'),(4078,'','default','Personalize blocks','','none'),(4079,'','default','Blocks consist of content or information that complements the main content of the page. Enable or disable optional blocks using the checkboxes below.','','none'),(4080,'','default','Block caching is inactive because you have enabled modules defining content access restrictions.','','none'),(4081,'','default','Controls the visual building blocks a page is constructed with. Blocks are boxes of content rendered into an area, or region, of a web page.','','none'),(4082,'; modules/block/block.js','default','Restricted to certain pages','','none'),(4083,'; modules/block/block.js','default','The block cannot be placed in this region.','','none'),(4084,'','default','Use for multi-user blogs. Every user gets a personal blog.','','none'),(4085,'','default','Single-user blogs','','none'),(4086,'','default','Each user\'s blog entries are automatically displayed with a link to the user\'s main blog page. You can create as many single-user blogs as you have site users with permission to create blog content.','','none'),(4087,'','default','Multi-user blogs','','none'),(4088,'','default','Blog entries from each single-user blog are also aggregated into one central multi-user blog, which displays the blog content of all users in a single listing.','','none'),(4089,'','default','There is an optional <em>Blogs</em> menu item added to the Navigation menu, which displays all blogs available on your site, and a <em>My blog</em> item displaying the current user\'s blog entries.','','none'),(4090,'','default','The Blog module also creates a default <em>Recent blog posts</em> block that may be enabled at the <a href=\"@blocks\">blocks administration page</a>.','','none'),(4091,'','default','Create new blog entry','','none'),(4092,'','default','Enables multi-user blogs.','','none'),(4093,'','default','No books available.','','none'),(4094,'','default','Content types allowed in book outlines','','none'),(4095,'','default','Users with the %outline-perm permission can add all content types.','','none'),(4096,'','default','Administer book outlines','','none'),(4097,'','default','The Book module is used for creating structured, multi-page content, such as site resource guides, manuals, and wikis. It allows you to create content that has chapters, sections, subsections, or any similarly-tiered structure. For more information, see the online handbook entry for <a href=\"@book\">Book module</a>.','','none'),(4098,'','default','Adding and managing book content','','none'),(4099,'','default','You can assign separate permissions for <em>creating</em>, <em>editing</em>, and <em>deleting</em> book content, as well as <em>adding content to books</em>, and <em>creating new books</em>. Users with the <em>Administer book outlines</em> permission can add <em>any</em> type of content to a book by selecting the appropriate book outline while editing the content. They can also view a list of all books, and edit and rearrange section titles on the <a href=\"@admin-book\">Book administration page</a>.','','none'),(4100,'','default','Book pages have a default book-specific navigation block. This navigation block contains links that lead to the previous and next pages in the book, and to the level above the current page in the book\'s structure. This block can be enabled on the <a href=\'@admin-block\'>Blocks administration page</a>. For book pages to show up in the book navigation, they must be added to a book outline.','','none'),(4101,'','default','Books can be created collaboratively, as they allow users with appropriate permissions to add pages into existing books, and add those pages to a custom table of contents menu.','','none'),(4102,'','default','Printing books','','none'),(4103,'','default','Users with the <em>View printer-friendly books</em> permission can select the <em>printer-friendly version</em> link visible at the bottom of a book page\'s content to generate a printer-friendly display of the page and all of its subsections.','','none'),(4104,'','default','The book module offers a means to organize a collection of related content pages, collectively known as a book. When viewed, this content automatically displays links to adjacent book pages, providing a simple navigation system for creating and reviewing structured content.','','none'),(4105,'','default','The outline feature allows you to include pages in the <a href=\"@book\">Book hierarchy</a>, as well as move them within the hierarchy or to <a href=\"@book-admin\">reorder an entire book</a>.','','none'),(4106,'','default','Create new books','','none'),(4107,'','default','Add content and child pages to books','','none'),(4108,'','default','View printer-friendly books','','none'),(4109,'','default','View a book page and all of its sub-pages as a single document for ease of printing. Can be performance heavy.','','none'),(4110,'','default','<em>Books</em> have a built-in hierarchical navigation. Use for handbooks or tutorials.','','none'),(4111,'','default','Allows users to create and organize related content in an outline.','','none'),(4112,'','default','The Color module allows users with the <em>Administer site configuration</em> permission to quickly and easily change the color scheme of themes that have been built to be compatible with it. For more information, see the online handbook entry for <a href=\"@color\">Color module</a>.','','7.16'),(4113,'','default','Changing colors','','7.16'),(4114,'','default','Using the Color module allows you to easily change the color of links, backgrounds, text, and other theme elements. To change the color settings for a compatible theme, select the <em>Settings</em> link for your theme on the <a href=\'@configure\'>Themes administration page</a>. If you don\'t see a color picker on that page, then your theme is not compatible with the color module. If you are sure that the theme does indeed support the color module, but the color picker does not appear, then <a href=\'@troubleshoot\'>follow these troubleshooting procedures</a>.','','7.16'),(4115,'','default','The Color module saves a modified copy of the theme\'s specified stylesheets in the files directory. This means that if you make any manual changes to your theme\'s stylesheet, <em>you must save your color settings again, even if they haven\'t changed</em>. This step is required because the module stylesheets (in the files directory) need to be recreated to include your changes.','','7.16'),(4116,'','default','The GD library for PHP is enabled, but was compiled without PNG support. Check the <a href=\"@url\">PHP image documentation</a> for information on how to correct this.','','none'),(4117,'','default','The GD library for PHP is missing or outdated. Check the <a href=\"@url\">PHP image documentation</a> for information on how to correct this.','','none'),(4118,'','default','Allows administrators to change the color scheme of compatible themes.','','none'),(4119,'','default','Select one or more comments to perform the update on.','','none'),(4120,'','default','There do not appear to be any comments to delete, or your selected comment was deleted by another administrator.','','none'),(4121,'','default','Deleted @count comments.','','none'),(4122,'','default','Deleted comment @cid and its replies.','','none'),(4123,'','default','Comment approved.','','none'),(4124,'','default','Tokens for comments posted on the site.','','7.16'),(4125,'','default','The Comment module allows users to comment on site content, set commenting defaults and permissions, and moderate comments. For more information, see the online handbook entry for <a href=\"@comment\">Comment module</a>.','','7.16'),(4126,'','default','Default and custom settings','','7.16'),(4127,'','default','Each <a href=\'@content-type\'>content type</a> can have its own default comment settings configured as: <em>Open</em> to allow new comments, <em>Hidden</em> to hide existing comments and prevent new comments, or <em>Closed</em> to view existing comments, but prevent new comments. These defaults will apply to all new content created (changes to the settings on existing content must be done manually). Other comment settings can also be customized per content type, and can be overridden for any given item of content. When a comment has no replies, it remains editable by its author, as long as the author has a user account and is logged in.','','7.16'),(4128,'','default','Unapproved comments (@count)','','7.16'),(4129,'','default','Administer comments and comment settings','','7.16'),(4130,'','default','Edit own comments','','7.16'),(4131,'','default','Number of recent comments','','none'),(4132,'','default','Threading','','7.16'),(4133,'','default','Show comment replies in a threaded list.','','7.16'),(4134,'','default','Default comment setting for new content','','7.16'),(4135,'','default','Allow comment title','','7.16'),(4136,'','default','Show reply form on the same page as comments','','7.16'),(4137,'','default','Users with the \"Post comments\" permission can post comments.','','7.16'),(4138,'','default','Users cannot post comments, but existing comments will be displayed.','','7.16'),(4139,'','default','Comments are hidden from view.','','7.16'),(4140,'','default','Users cannot post comments.','','7.16'),(4141,'','default','Your comment has been queued for review by site administrators and will be published after approval.','','none'),(4142,'','default','Your comment has been posted.','','none'),(4143,'','default','<a href=\"@login\">Log in</a> or <a href=\"@register\">register</a> to post comments','','7.16'),(4144,'','default','<a href=\"@login\">Log in</a> to post comments','','none'),(4145,'','default','Flat list','','none'),(4146,'','default','Threaded list','','none'),(4147,'','default','The comment will be unpublished if it contains any of the phrases above. Use a case-sensitive, comma-separated list of phrases. Example: funny, bungee jumping, \"Company, Inc.\"','','none'),(4148,'','default','Published comment %subject.','','none'),(4149,'','default','Saved comment %title','','none'),(4150,'','default','List and edit site comments and the comment approval queue.','','7.16'),(4151,'','default','Unapproved comments','','none'),(4152,'','default','Example: \'webmaster@example.com\' or \'sales@example.com,support@example.com\' . To specify multiple recipients, separate each e-mail address with a comma.','','none'),(4153,'','default','Category %category has been saved.','','none'),(4154,'','default','You cannot send more than %limit messages in @interval. Try again later.','','none'),(4155,'','default','Contact @username','','none'),(4156,'','default','%sender-name (@sender-from) sent an e-mail regarding %category.','','none'),(4157,'','default','%sender-name (@sender-from) sent %recipient-name an e-mail.','','none'),(4158,'','default','The Contact module allows visitors to contact site administrators and other users. Users specify a subject, write their message, and can have a copy of their message sent to their own e-mail address. For more information, see the online handbook entry for <a href=\"@contact\">Contact module</a>.','','none'),(4159,'','default','User contact forms','','none'),(4160,'','default','Site users can be contacted with a user contact form that keeps their e-mail address private. Users may enable or disable their personal contact forms by editing their <em>My account</em> page. If enabled, a <em>Contact</em> tab leads to a personal contact form displayed on their user profile. Site administrators are still able to use the contact form, even if has been disabled. The <em>Contact</em> tab is not shown when you view your own profile.','','none'),(4161,'','default','Site-wide contact forms','','none'),(4162,'','default','The <a href=\"@contact\">Contact page</a> provides a simple form for users with the <em>Use the site-wide contact form</em> permission to send comments, feedback, or other requests. You can create categories for directing the contact form messages to a set of defined recipients. Common categories for a business site, for example, might include \"Website feedback\" (messages are forwarded to website administrators) and \"Product information\" (messages are forwarded to members of the sales department). E-mail addresses defined within a category are not displayed publicly.','','none'),(4163,'','default','When the site-wide contact form is enabled, a link in the main <em>Navigation</em> menu is created, but the link is disabled by default. This menu link can be enabled on the <a href=\'@menu\'>Menus administration page</a>.','','none'),(4164,'','default','Customization','','none'),(4165,'','default','If you would like additional text to appear on the site-wide or personal contact page, use a block. You can create and edit blocks on the <a href=\"@blocks\">Blocks administration page</a>.','','none'),(4166,'','default','Add one or more categories on this page to set up your site-wide <a href=\"@form\">contact form</a>.','','none'),(4167,'','default','A <em>Contact</em> menu item (disabled by default) is added to the Navigation menu, which you can modify on the <a href=\"@menu-settings\">Menus administration page</a>.','','none'),(4168,'','default','If you would like additional text to appear on the site-wide contact page, use a block. You can create and edit blocks on the <a href=\"@blocks\">Blocks administration page</a>.','','none'),(4169,'','default','Administer contact forms and contact form settings','','none'),(4170,'','default','Use the site-wide contact form','','none'),(4171,'','default','Use users\' personal contact forms','','none'),(4172,'','default','!sender-name (!sender-url) sent a message using the contact form at !form-url.','','none'),(4173,'','default','[!site-name] !subject','','none'),(4174,'','default','!sender-name (!sender-url) has sent you a message via your contact form (!form-url) at !site-name.','','none'),(4175,'','default','If you don\'t want to receive such e-mails, you can change your settings at !recipient-edit-url.','','none'),(4176,'','default','Allow other users to contact you via a <a href=\"@url\">personal contact form</a> which keeps your e-mail address hidden. Note that some privileged users such as site administrators are still able to contact you even if you choose to disable this feature.','','none'),(4177,'','default','Enable the personal contact form by default for new users.','','none'),(4178,'','default','Changing this setting will not affect existing users.','','none'),(4179,'','default','The Contextual links module displays links related to regions of pages on your site to users with <em>access contextual links</em> permission. For more information, see the online handbook entry for <a href=\"@contextual\">Contextual links module</a>.','','7.16'),(4180,'','default','Displaying contextual links','','7.16'),(4181,'','default','Contextual links are supplied by modules, to give you quick access to tasks associated with regions of pages on your site. For instance, if you have a custom menu block displayed in a sidebar of your site, the Blocks and Menus modules will supply links to configure the block and edit the menu. The Contextual links module collects these links into a list for display by your theme, and also adds JavaScript code to the page to hide the links initially, and display them when your mouse hovers over the block.','','7.16'),(4182,'','default','Use contextual links','','7.16'),(4183,'','default','Use contextual links to perform actions related to elements on a page.','','7.16'),(4184,'','default','Contextual links','','none'),(4185,'','default','Provides contextual links to perform actions related to elements on a page.','','none'),(4186,'','default','Tracking user activity','','7.16'),(4187,'','default','By enabling blocks such as <em>Who\'s online</em> and <em>Who\'s new</em>, site users can track who is logged in and new user signups at a centralized location.','','7.16'),(4188,'','default','Tracking content activity','','7.16'),(4189,'','default','By enabling blocks such as <em>Recent blog posts</em>, <em>New forum topics</em> and <em>Recent comments</em>, site users can view newly added site content at a glance.','','7.16'),(4190,'','default','View the administrative dashboard','','7.16'),(4191,'','default','This dashboard region is empty. Click <em>Customize dashboard</em> to add blocks to it.','','7.16'),(4192,'','default','DRAG HERE','','7.16'),(4193,'','default','Provides a dashboard page in the administrative interface for organizing administrative tasks and tracking information within your site.','','none'),(4194,'; modules/dashboard/dashboard.js','default','Customize dashboard','','7.16'),(4195,'','default','Clear log messages','','none'),(4196,'','default','This will permanently remove the log messages from the database.','','none'),(4197,'','default','Database log cleared.','','none'),(4198,'','default','The Database logging module logs system events in the Drupal database. For more information, see the online handbook entry for the <a href=\"@dblog\">Database logging module</a>.','','7.16'),(4199,'','default','Monitoring your site','','7.16'),(4200,'','default','Debugging site problems','','7.16'),(4201,'','default','Field validation errors','','none'),(4202,'','default','Attempt to create a field with a name longer than 32 characters: %name','','none'),(4203,'','default','Attempt to create field name %name which already exists and is active.','','none'),(4204,'','default','Attempt to create field name %name which already exists, although it is inactive.','','none'),(4205,'','default','Attempt to create field name %name which is reserved by entity type %type.','','none'),(4206,'','default','Attempt to create a field of unknown type %type.','','none'),(4207,'','default','Attempt to create a field with unknown storage type %type.','','none'),(4208,'','default','Attempt to create an instance of field @field_name without a bundle.','','none'),(4209,'','default','Enabling field types','','7.16'),(4210,'','default','The Field module provides the infrastructure for fields and field attachment; the field types and input widgets themselves are provided by additional modules. Some of the modules are required; the optional modules can be enabled from the <a href=\"@modules\">Modules administration page</a>. Drupal core includes the following field type modules: Number (required), Text (required), List (required), Taxonomy (optional), Image (optional), and File (optional); the required Options module provides input widgets for other field modules. Additional fields and widgets may be provided by contributed modules, which you can find in the <a href=\"@contrib\">contributed module section of Drupal.org</a>. Currently enabled field and input widget modules:','','7.16'),(4211,'','default','Managing field data storage','','7.16'),(4212,'','default','Developers of field modules can either use the default <a href=\"@sql-store\">Field SQL storage module</a> to store data for their fields, or a contributed or custom module developed using the <a href=\"@storage-api\">field storage API</a>.','','7.16'),(4213,'','default','The Field SQL storage module stores field data in the database. It is the default field storage module; other field storage mechanisms may be available as contributed modules. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.','','7.16'),(4214,'','default','Field SQL storage','','none'),(4215,'','default','Stores field data in an SQL database.','','none'),(4216,'','default','The List module defines various fields for storing a list of items, for use with the Field module. Usually these items are entered through a select list, checkboxes, or radio buttons. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.','','7.16'),(4217,'','default','The \'checkboxes/radio buttons\' widget will display checkboxes if the <em>Number of values</em> option is greater than 1 for this field, otherwise radios will be displayed.','','none'),(4218,'','default','Allowed HTML tags in labels: @tags','','none'),(4219,'','default','The value of this field is being determined by the %function function and may not be changed.','','none'),(4220,'','default','Allowed values list: each key must be a valid integer or decimal.','','none'),(4221,'','default','Allowed values list: each key must be a string at most 255 characters long.','','none'),(4222,'','default','Allowed values list: keys must be integers.','','none'),(4223,'','default','Defines list field types. Use with Options to create selection lists.','','none'),(4224,'','default','The Number module defines various numeric field types for the Field module. Numbers can be in integer, decimal, or floating-point form, and they can be formatted when displayed. Number fields can be limited to a specific set of input values or to a range of values. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.','','7.16'),(4225,'','default','The minimum value that should be allowed in this field. Leave blank for no minimum.','','none'),(4226,'','default','The maximum value that should be allowed in this field. Leave blank for no maximum.','','none'),(4227,'','default','Define a string that should be prefixed to the value, like \'$ \' or \'&euro; \'. Leave blank for none. Separate singular and plural values with a pipe (\'pound|pounds\').','','none'),(4228,'','default','Only numbers and the decimal separator (@separator) allowed in %field.','','none'),(4229,'','default','The Options module defines checkbox, selection, and other input widgets for the Field module. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.','','7.16'),(4230,'','default','The Text module defines various text field types for the Field module. A text field may contain plain text only, or optionally, may use Drupal\'s <a href=\'@filter-help\'>text filters</a> to securely manage HTML output. Text input fields may be either a single line (text field), multiple lines (text area), or for greater input control, a select box, checkbox, or radio buttons. If desired, the field can be validated, so that it is limited to a set of allowed values. See the <a href=\'@field-help\'>Field module help page</a> for more information about fields.','','7.16'),(4231,'','default','Filtered text (user selects text format)','','none'),(4232,'','default','Summary input','','none'),(4233,'','default','This allows authors to input an explicit summary, to be displayed instead of the automatically trimmed text when using the \"Summary or trimmed\" display type.','','none'),(4234,'','default','%name: the text may not be longer than %max characters.','','none'),(4235,'','default','%name: the summary may not be longer than %max characters.','','none'),(4236,'','default','Leave blank to use trimmed value of full tex