.16'),(4295,'','default','When you attach a file to content, you can specify whether it is <em>listed</em> or not. Listed files are displayed automatically in a section at the bottom of your content; non-listed files are available for embedding in your content, but are not included in the list at the bottom.','','7.16'),(4296,'','default','Managing file locations','','7.16'),(4297,'','default','When you create a File field, you can specify a directory where the files will be stored, which can be within either the <em>public</em> or <em>private</em> files directory. Files in the public directory can be accessed directly through the web server; when public files are listed, direct links to the files are used, and anyone who knows a file\'s URL can download the file. Files in the private directory are not accessible directly through the web server; when private files are listed, the links are Drupal path requests. This adds to server load and download time, since Drupal must start up and resolve the path for each file download request, but allows for access restrictions.','','7.16'),(4298,'','default','An unrecoverable error occurred. Use of this form has expired. Try reloading the page and submitting again.','','none'),(4299,'','default','The file referenced by the !name field does not exist.','','none'),(4300,'','default','The file in the !name field was unable to be uploaded.','','none'),(4301,'','default','The upload directory %directory for the file field !name could not be created or is not accessible. A newly uploaded file could not be saved in this directory as a consequence, and the upload was canceled.','','none'),(4302,'','default','Your server is not capable of displaying file upload progress. File upload progress requires an Apache server running PHP with mod_php.','','none'),(4303,'','default','All roles may use this format','','none'),(4304,'','default','The text format ordering has been saved.','','none'),(4305,'','default','Add text format','','7.16'),(4306,'','default','All roles for this text format must be enabled and cannot be changed.','','none'),(4307,'','default','Filter processing order','','none'),(4308,'','default','Text format names must be unique. A format named %name already exists.','','none'),(4309,'','default','Added text format %format.','','none'),(4310,'','default','The text format %format has been updated.','','none'),(4311,'','default','The Filter module allows administrators to configure text formats. A text format defines the HTML tags, codes, and other input allowed in content and comments, and is a key feature in guarding against potentially damaging input from malicious users. For more information, see the online handbook entry for <a href=\"@filter\">Filter module</a>.','','7.16'),(4312,'','default','Applying filters to text','','7.16'),(4313,'','default','Each text format uses filters to manipulate text, and most formats apply several different filters to text in a specific order. Each filter is designed for a specific purpose, and generally either adds, removes, or transforms elements within user-entered text before it is displayed. A filter does not change the actual content, but instead, modifies it temporarily before it is displayed. One filter may remove unapproved HTML tags, while another automatically adds HTML to make URLs display as clickable links.','','7.16'),(4314,'','default','Defining text formats','','7.16'),(4315,'','default','One format is included by default: <em>Plain text</em> (which removes all HTML tags). Additional formats may be created by your installation profile when you install Drupal, and more can be created by an administrator on the <a href=\"@text-formats\">Text formats page</a>.','','7.16'),(4316,'','default','Choosing a text format','','7.16'),(4317,'','default','A text format contains filters that change the user input, for example stripping out malicious HTML or making URLs clickable. Filters are executed from top to bottom and the order is important, since one filter may prevent another filter from doing its job. For example, when URLs are converted into links before disallowed HTML tags are removed, all links may be removed. When this happens, the order of filters may need to be re-arranged.','','none'),(4318,'','default','Warning: This permission may have security implications depending on how the text format is configured.','','7.16'),(4319,'','default','Use the !text_format text format','','7.16'),(4320,'','default','More information about text formats','','7.16'),(4321,'','default','Limit allowed HTML tags','','7.16'),(4322,'','default','Convert line breaks into HTML (i.e. <code>&lt;br&gt;</code> and <code>&lt;p&gt;</code>)','','7.16'),(4323,'','default','Convert URLs into links','','7.16'),(4324,'','default','Correct faulty and chopped off HTML','','7.16'),(4325,'','default','Display any HTML as plain text','','7.16'),(4326,'','default','A list of HTML tags that can be used. JavaScript event attributes, JavaScript URLs, and CSS are always stripped.','','none'),(4327,'','default','Display basic HTML help in long filter tips','','none'),(4328,'','default','Add rel=\"nofollow\" to all links','','none'),(4329,'','default','This site allows HTML content. While learning all of HTML may feel intimidating, learning how to use a very small number of the most basic HTML \"tags\" is very easy. This table provides examples for each tag that is enabled on this site.','','7.16'),(4330,'','default','For more information see W3C\'s <a href=\"@html-specifications\">HTML Specifications</a> or use your favorite search engine to find other sites that explain HTML.','','7.16'),(4331,'','default','Most unusual characters can be directly entered without any problems.','','7.16'),(4332,'','default','If you do encounter problems, try using HTML character entities. A common example looks like &amp;amp; for an ampersand &amp; character. For a full list of entities see HTML\'s <a href=\"@html-entities\">entities</a> page. Some of t