quired module to install @module.','','none'),(4852,'','default','You must enable the @required modules to install @module.','','none'),(4853,'','default','Tokens for site-wide settings and other global information.','','7.16'),(4854,'','default','Tokens related to times and dates.','','7.16'),(4855,'','default','Tokens related to uploaded files.','','7.16'),(4856,'','default','URL (brief)','','7.16'),(4857,'','default','The URL of the site\'s front page without the protocol.','','7.16'),(4858,'','default','Short format','','7.16'),(4859,'','default','A date in \'short\' format. (%date)','','7.16'),(4860,'','default','Medium format','','7.16'),(4861,'','default','A date in \'medium\' format. (%date)','','7.16'),(4862,'','default','Long format','','7.16'),(4863,'','default','A date in \'long\' format. (%date)','','7.16'),(4864,'','default','A date in a custom format. See !php-date for details.','','7.16'),(4865,'','default','the PHP documentation','','7.16'),(4866,'','default','Time-since','','7.16'),(4867,'','default','Raw timestamp','','7.16'),(4868,'','default','A date in UNIX timestamp format (%date)','','7.16'),(4869,'','default','The System module is integral to the site, and provides basic but extensible functionality for use by other modules and themes. Some integral elements of Drupal are contained in and managed by the System module, including caching, enabling and disabling modules and themes, preparing and displaying the administrative page, and configuring fundamental site settings. A number of key system maintenance operations are also part of the System module. For more information, see the online handbook entry for <a href=\"@system\">System module</a>.','','7.16'),(4870,'','default','Managing modules','','7.16'),(4871,'','default','The System module allows users with the appropriate permissions to enable and disable modules on the <a href=\"@modules\">Modules administration page</a>. Drupal comes with a number of core modules, and each module provides a discrete set of features and may be enabled or disabled depending on the needs of the site. Many additional modules contributed by members of the Drupal community are available for download at the <a href=\"@drupal-modules\">Drupal.org module page</a>.','','7.16'),(4872,'','default','Managing themes','','7.16'),(4873,'','default','The System module allows users with the appropriate permissions to enable and disable themes on the <a href=\"@themes\">Appearance administration page</a>. Themes determine the design and presentation of your site. Drupal comes packaged with several core themes, and additional contributed themes are available at the <a href=\"@drupal-themes\">Drupal.org theme page</a>.','','7.16'),(4874,'','default','Managing caching','','7.16'),(4875,'','default','The System module allows users with the appropriate permissions to manage caching on the <a href=\'@cache-settings\'>Performance settings page</a>. Drupal has a robust caching system that allows the efficient re-use of previously-constructed web pages and web page components. Pages requested by anonymous users are stored in a compressed format; depending on your site configuration and the amount of your web traffic tied to anonymous visitors, the caching system may significantly increase the speed of your site.','','7.16'),(4876,'','default','Performing system maintenance','','7.16'),(4877,'','default','Configuring basic site settings','','7.16'),(4878,'','default','The System module also handles basic configuration options for your site, including <a href=\"@date-time-settings\">Date and time settings</a>, <a href=\"@file-system\">File system settings</a>, <a href=\"@clean-url\">Clean URL support</a>, <a href=\"@site-info\">Site name and other information</a>, and a <a href=\"@maintenance-mode\">Maintenance mode</a> for taking your site temporarily offline.','','7.16'),(4879,'','default','Configuring actions','','7.16'),(4880,'','default','Actions are individual tasks that the system can do, such as unpublishing a piece of content or banning a user. Modules, such as the <a href=\"@trigger-help\">Trigger module</a>, can fire these actions when certain system events happen; for example, when a new post is added or when a user logs in. Modules may also provide additional actions. Visit the <a href=\"@actions\">Actions page</a> to configure actions.','','7.16'),(4881,'','default','Set and configure the default theme for your website.  Alternative <a href=\"@themes\">themes</a> are available.','','none'),(4882,'','default','Download additional <a href=\"@modules\">contributed modules</a> to extend Drupal\'s functionality.','','none'),(4883,'','default','Regularly review and install <a href=\"@updates\">available updates</a> to maintain a secure and current site. Always run the <a href=\"@update-php\">update script</a> each time a module is updated.','','none'),(4884,'','default','Regularly review <a href=\"@updates\">available updates</a> to maintain a secure and current site. Always run the <a href=\"@update-php\">update script</a> each time a module is updated.','','none'),(4885,'','default','Regularly review available updates to maintain a secure and current site. Always run the <a href=\"@update-php\">update script</a> each time a module is updated. Enable the Update manager module to update and install modules and themes.','','none'),(4886,'','default','If you are upgrading to a newer version of Drupal or upgrading contributed modules or themes, you may need to run the <a href=\"@update-php\">update script</a>.','','none'),(4887,'','default','There are two types of actions: simple and advanced. Simple actions do not require any additional configuration, and are listed here automatically. Advanced actions need to be created and configured before they can be used, because they have options that need to be specified; for example, sending an e-mail to a specified address, or unpublishing content containing certain words. To create an advanced action, select the action from the drop-down list in the advanced action section below and click the <em>Create</em> button.','','none'),(4888,'','default','An advanced action offers additional configuration options which may be filled out below. Changing the <em>Description</em> field is recommended, in order to better identify the precise action taking place. This description will be displayed in modules such as the Trigger module when assigning actions to system events, so it is best if it is as descriptive as possible (for example, \"Send e-mail to Moderation Team\" rather than simply \"Send e-mail\").','','none'),(4889,'','default','Administer modules','','7.16'),(4890,'','default','Administer site configuration','','7.16'),(4891,'','default','Administer themes','','7.16'),(4892,'','default','Administer actions','','7.16'),(4893,'','default','Use the administration pages and help','','7.16'),(4894,'','default','Use the site in maintenance mode','','7.16'),(4895,'','default','View site reports','','7.16'),(4896,'','default','Block IP addresses','','7.16'),(4897,'','default','Private local files served by Drupal.','','7.16'),(4898,'','default','Update modules','','none'),(4899,'','default','Update themes','','none'),(4900,'','default','SSH','','none'),(4901,'','default','Your password is not saved in the database and is only used to establish a connection.','','none'),(4902,'','default','The connection will be created between your web server and the machine hosting the web server files. In the vast majority of cases, this will be the same machine, and \"localhost\" is correct.','','none'),(4903,'','default','Configure your <a href=\"@user-edit\">account time zone setting</a>.','','none'),(4904,'','default','Select the desired local time and time zone. Dates and times throughout this site will be displayed using this time zone.','','7.16'),(4905,'','default','Your time zone setting will be automatically detected if possible. Confirm the selection and click save.','','none'),(4906,'','default','The directory %directory does not exist and could not be created.','','none'),(4907,'','default','The directory %directory exists but is not writable and could not be made writable.','','none'),(4908,'','default','The email address to which the message should be sent OR enter [node:author:mail], [comment:author:mail], etc. if you would like to send an e-mail to the author of the original post.','','none'),(4909,'','default','The message that should be sent. You may include placeholders like [node:title], [user:name], and [comment:body] to represent data that will be different each time message is sent. Not all placeholders will be available in all contexts.','','none'),(4910,'','default','The message to be displayed to the current user. You may include placeholders like [node:title], [user:name], and [comment:body] to represent data that will be different each time message is sent. Not all placeholders will be available in all contexts.','','none'),(4911,'','default','Powered by <a href=\"@poweredby\">Drupal</a>','','7.16'),(4912,'','default','AHAH callback','','7.16'),(4913,'','default','Select and configure your theme','','7.16'),(4914,'','default','Enable theme','','none'),(4915,'','default','Disable theme','','none'),(4916,'','default','Set default theme','','none'),(4917,'','default','Configure default and theme specific settings.','','7.16'),(4918,'','default','Delete IP address','','none'),(4919,'','default','Add new date type.','','7.16'),(4920,'','default','Delete date type','','none'),(4921,'','default','Allow users to delete a configured date type.','','none'),(4922,'','default','Configure display format strings for date and time.','','7.16'),(4923,'','default','Edit date format','','none'),(4924,'','default','Allow users to edit a configured date format.','','none'),(4925,'','default','The host !host is no longer blocked because it is not a valid IP address.','','none'),(4926,'','default','Inserted into {role_permission} the permissions for role ID !id','','none'),(4927,'','default','Aggressive caching was disabled and replaced with normal caching. Read the page caching section in default.settings.php for more information on how to enable similar functionality.','','none'),(4928,'','default','%profile_name (%profile-%version)','','none'),(4929,'','default','The phpinfo() function has been disabled for security reasons. To see your server\'s phpinfo() information, change your PHP settings or contact your server administrator. For more information, <a href=\"@phpinfo\">Enabling and disabling phpinfo()</a> handbook page.','','none'),(4930,'','default','An automated attempt to create this directory failed, possibly due to a permissions problem. To proceed with the installation, either create the directory and modify its permissions manually or ensure that the installer has the permissions to create it automatically. For more information, see INSTALL.txt or the <a href=\"@handbook_url\">online handbook</a>.','','none'),(4931,'','default','Your configuration has been saved.','','7.16'),(4932,'','default','No vocabularies available. <a href=\"@link\">Add vocabulary</a>.','','none'),(4933,'','default','No terms available. <a href=\"@link\">Add term</a>.','','none'),(4934,'','default','There is currently no content classified with this term.','','none'),(4935,'','default','Tokens related to taxonomy terms.','','7.16'),(4936,'','default','Tokens related to taxonomy vocabularies.','','7.16'),(4937,'','default','The Taxonomy module allows you to classify the content of your website. To classify content, you define <em>vocabularies</em> that contain related <em>terms</em>, and then assign the vocabularies to content types. For more information, see the online handbook entry for the <a href=\"@taxonomy\">Taxonomy module</a>.','','7.16'),(4938,'','default','Creating vocabularies','','7.16'),(4939,'','default','Users with sufficient <a href=\"@perm\">permissions</a> can create <em>vocabularies</em> and <em>terms</em> through the <a href=\"@taxo\">Taxonomy page</a>. The page listing the terms provides a drag-and-drop interface for controlling the order of the terms and sub-terms within a vocabulary, in a hierarchical fashion. A <em>controlled vocabulary</em> classifying music by genre with terms and sub-terms could look as follows:','','7.16'),(4940,'','default','<em>vocabulary</em>: Music','','7.16'),(4941,'','default','<em>term</em>: Jazz','','7.16'),(4942,'','default','<em>sub-term</em>: Swing','','7.16'),(4943,'','default','<em>sub-term</em>: Fusion','','7.16'),(4944,'','default','<em>term</em>: Rock','','7.16'),(4945,'','default','<em>sub-term</em>: Country rock','','7.16'),(4946,'','default','<em>sub-term</em>: Hard rock','','7.16'),(4947,'','default','You can assign a sub-term to multiple parent terms. For example, <em>fusion</em> can be assigned to both <em>rock</em> and <em>jazz</em>.','','7.16'),(4948,'','default','Terms in a <em>free-tagging vocabulary</em> can be built gradually as you create or edit content. This is often done used for blogs or photo management applications.','','7.16'),(4949,'','default','Assigning vocabularies to content types','','7.16'),(4950,'','default','Before you can use a new vocabulary to classify your content, a new Taxonomy term field must be added to a <a href=\"@ctedit\">content type</a> on its <em>manage fields</em> page. When adding a taxonomy field, you choose a <em>widget</em> to use to enter the taxonomy information on the content editing page: a select list, checkboxes, radio buttons, or an auto-complete field (to build a free-tagging vocabulary). After choosing the field type and widget, on the subsequent <em>field settings</em> page you can choose the desired vocabulary, whether one or multiple terms can be chosen from the vocabulary, and other settings. The same vocabulary can be added to multiple content types, by using the \"Add existing field\" section on the manage fields page.','','7.16'),(4951,'','default','Classifying content','','7.16'),(4952,'','default','After the vocabulary is assigned to the content type, you can start classifying content. The field with terms will appear on the content editing screen when you edit or <a href=\"@addnode\">add new content</a>.','','7.16'),(4953,'','default','Viewing listings and RSS feeds by term','','7.16'),(4954,'','default','Each taxonomy term automatically provides a page listing content that has its classification, and a corresponding RSS feed. For example, if the taxonomy term <em>country rock</em> has the ID 123 (you can see this by looking at the URL when hovering on the linked term, which you can click to navigate to the listing page), then you will find this list at the path <em>taxonomy/term/123</em>. The RSS feed will use the path <em>taxonomy/term/123/feed</em> (the RSS icon for this term\'s listing will automatically display in your browser\'s address bar when viewing the listing page).','','7.16'),(4955,'','default','Extending Taxonomy module','','7.16'),(4956,'','default','There are <a href=\"@taxcontrib\">many contributed modules</a> that extend the behavior of the Taxonomy module for both display and organization of terms.','','7.16'),(4957,'','default','Taxonomy is for categorizing content. Terms are grouped into vocabularies. For example, a vocabulary called \"Fruit\" would contain the terms \"Apple\" and \"Banana\".','','none'),(4958,'','default','You can reorganize the terms in %capital_name using their drag-and-drop handles, and group terms under a parent term by sliding them under and to the right of the parent.','','none'),(4959,'','default','%capital_name contains terms grouped under parent terms. You can reorganize the terms in %capital_name using their drag-and-drop handles.','','none'),(4960,'','default','%capital_name contains terms with multiple parents. Drag and drop of terms with multiple parents is not supported, but you can re-enable drag-and-drop support by editing each term to include only a single parent.','','none'),(4961,'','default','Administer vocabularies and terms','','7.16'),(4962,'','default','Edit terms in %vocabulary','','7.16'),(4963,'','default','Delete terms from %vocabulary','','7.16'),(4964,'','default','The vocabulary which supplies the options for this field.','','none'),(4965,'','default','The Toolbar module displays links to top-level administration menu items and links from other modules at the top of the screen. For more information, see the online handbook entry for <a href=\"@toolbar\">Toolbar module</a>.','','none'),(4966,'','default','Displaying administrative links','','none'),(4967,'','default','Use the administration toolbar','','none'),(4968,'','default','Toggle drawer visibility','','none'),(4969,'','default','Provides a toolbar that shows the top-level administration menu items and links from other modules.','','none'),(4970,'','default','The Tracker module displays the most recently added and updated content on your site, and allows you to follow new content created by each user. This module has no configuration options. For more information, see the online handbook entry for <a href=\"@tracker\">Tracker module</a>.','','none'),(4971,'','default','The Tracker module adds a new menu item to the Navigation menu, called <em>Recent content</em>. You can configure menu items via the <a href=\"@menus\">Menus administration page</a>.','','none'),(4972,'','default','Tracking new and updated site content','','none'),(4973,'','default','The <a href=\'@recent\'>Recent content</a> page shows new and updated content in reverse chronological order, listing the content type, title, author\'s name, number of comments, and time of last update. Content is considered updated when changes occur in the text, or when new comments are added. The <em>My recent content</em> tab limits the list to the currently logged-in user.','','none'),(4974,'','default','Tracking user-specific content','','none'),(4975,'','default','To follow a specific user\'s new and updated content, select the <em>Track</em> tab from the user\'s profile page.','','none'),(4976,'','default','All recent content','','none'),(4977,'','default','My recent content','','none'),(4978,'','default','Track content','','none'),(4979,'','default','Enables tracking of recent content for users.','','none'),(4980,'','default','The Content translation module allows content to be translated into different languages. Working with the <a href=\"@locale\">Locale module</a> (which manages enabled languages and provides translation for the site interface), the Content translation module is key to creating and maintaining translated site content. For more information, see the online handbook entry for <a href=\"@translation\">Content translation module</a>.','','none'),(4981,'','default','Configuring content types for translation','','none'),(4982,'','default','To configure a particular content type for translation, visit the <a href=\"@content-types\">Content types</a> page, and click the <em>edit</em> link for the content type. In the <em>Publishing options</em> section, select <em>Enabled, with translation</em> under <em>Multilingual support</em>.','','none'),(4983,'','default','Assigning a language to content','','none'),(4984,'','default','Use the <em>Language</em> drop down to select the appropriate language when creating or editing content.','','none'),(4985,'','default','Translating content','','none'),(4986,'','default','Users with the <em>translate content</em> permission can translate content, if the content type has been configured to allow translations. To translate content, select the <em>Translation</em> tab when viewing the content, select the language for which you wish to provide content, and then enter the content.','','none'),(4987,'','default','Maintaining translations','','none'),(4988,'','default','If editing content in one language requires that translated versions also be updated to reflect the change, use the <em>Flag translations as outdated</em> check box to mark the translations as outdated and in need of revision. Individual translations may also be marked for revision by selecting the <em>This translation needs to be updated</em> check box on the translation editing form.','','none'),(4989,'','default','Translate content','','none'),(4990,'','default','There is already a translation in this language.','','none'),(4991,'','default','Trigger: !description','','none'),(4992,'','default','No actions available for this trigger. <a href=\"@link\">Add action</a>.','','none'),(4993,'','default','Missing/undefined save action (%save_aid) for %aid action.','','none'),(4994,'','default','The %label action has been appended, which is required to save the property change.','','none'),(4995,'','default','The %label action was moved to save the property change.','','none'),(4996,'','default','Triggers are events on your site, such as new content being added or a user logging in. The Trigger module associates these triggers with actions (functional tasks), such as unpublishing content containing certain keywords or e-mailing an administrator. The <a href=\"@url\">Actions settings page</a> contains a list of existing actions and provides the ability to create and configure advanced actions (actions requiring configuration, such as an e-mail address or a list of banned words).','','none'),(4997,'','default','The Trigger module provides the ability to cause <em>actions</em> to run when certain <em>triggers</em> take place on your site. Triggers are events, such as new content being added to your site or a user logging in, and actions are tasks, such as unpublishing content or e-mailing an administrator. For more information, see the online handbook entry for <a href=\"@trigger\">Trigger module</a>.','','none'),(4998,'','default','Configuring triggers and actions','','none'),(4999,'','default','The combination of actions and triggers can perform many useful tasks, such as e-mailing an administrator if a user account is deleted, or automatically unpublishing comments that contain certain words. To set up a trigger/action combination, first visit the <a href=\"@actions-page\">Actions configuration page</a>, where you can either verify that the action you want is already listed, or create a new <em>advanced</em> action. You will need to set up an advanced action if there are configuration options in your trigger/action combination, such as specifying an e-mail address or a list of banned words. After configuring or verifying your action, visit the <a href=\"@triggers-page\">Triggers configuration page</a> and choose the appropriate tab (Comment, Taxonomy, etc.), where you can assign the action to run when the trigger event occurs.','','none'),(5000,'','default','When either saving new content or updating existing content','','none'),(5001,'','default','After saving updated content','','none'),(5002,'','default','When either saving a new comment or updating an existing comment','','none'),(5003,'','default','After creating a new user account','','none'),(5004,'','default','After updating a user account','','none'),(5005,'','default','Configure when to execute actions.','','none'),(5006,'','default','Installing updates','','none'),(5007,'','default','Preparing to update your site','','none'),(5008,'','default','Installing %project','','none'),(5009,'','default','Preparing to install','','none'),(5010,'','default','Error installing / updating','','none'),(5011,'','default','Installed %project_name successfully','','none'),(5012,'','default','Update was completed successfully. Your site has been taken out of maintenance mode.','','none'),(5013,'','default','Update was completed successfully.','','none'),(5014,'','default','Update failed! See the log below for more information.','','none'),(5015,'','default','Update failed! See the log below for more information. Your site is still in maintenance mode.','','none'),(5016,'','default','Installation was completed successfully. Your site h