e doesn\'t exist.','','none'),(5249,'','default','Cannot rename %table to %table_new: table %table_new already exists.','','none'),(5250,'','default','Cannot add field %table.%field: table doesn\'t exist.','','none'),(5251,'','default','Cannot add field %table.%field: field already exists.','','none'),(5252,'','default','Cannot set default value of field %table.%field: field doesn\'t exist.','','none'),(5253,'','default','Cannot remove default value of field %table.%field: field doesn\'t exist.','','none'),(5254,'','default','Cannot add primary key to table %table: table doesn\'t exist.','','none'),(5255,'','default','Cannot add primary key to table %table: primary key already exists.','','none'),(5256,'','default','Cannot add unique key %name to table %table: table doesn\'t exist.','','none'),(5257,'','default','Cannot add unique key %name to table %table: unique key already exists.','','none'),(5258,'','default','Cannot add index %name to table %table: table doesn\'t exist.','','none'),(5259,'','default','Cannot add index %name to table %table: index already exists.','','none'),(5260,'','default','Cannot change the definition of field %table.%name: field doesn\'t exist.','','none'),(5261,'','default','Cannot rename field %table.%name to %name_new: target field already exists.','','none'),(5262,'','default','Use this page to create a new custom block.','','7.16'),(5263,'','default','Number of recent blog posts to display','','none'),(5264,'','default','Edit comment %comment','','none'),(5265,'','default','The Field UI module provides an administrative user interface (UI) for attaching and managing fields. Fields can be defined at the content-type level for content items and comments, at the vocabulary level for taxonomy terms, and at the site level for user accounts. Other modules may also enable fields to be defined for their data. Field types (text, image, number, etc.) are defined by modules, and collected and managed by the <a href=\"@field\">Field module</a>. For more information, see the online handbook entry for <a href=\"@field_ui\" target=\"_blank\">Field UI module</a>.','','7.16'),(5266,'','default','Planning fields','','7.16'),(5267,'','default','What the field will be called','','7.16'),(5268,'','default','A field has a <em>label</em> (the name displayed in the user interface) and a <em>machine name</em> (the name used internally). The label can be changed after you create the field, if needed, but the machine name cannot be changed after you have created the field.','','7.16'),(5269,'','default','What type of data the field will store','','7.16'),(5270,'','default','Each field can store one type of data (text, number, file, etc.). When you define a field, you choose a particular <em>field type</em>, which corresponds to the type of data you want to store. The field type cannot be changed after you have created the field.','','7.16'),(5271,'','default','How the data will be input and displayed','','7.16'),(5272,'','default','How many values the field will store','','7.16'),(5273,'','default','You can store one value, a specific maximum number of values, or an unlimited number of values in each field. For example, an employee identification number field might store a single number, whereas a phone number field might store multiple phone numbers. This setting can be changed after you have created the field, but if you reduce the maximum number of values, you may lose information.','','7.16'),(5274,'','default','Reusing fields','','7.16'),(5275,'','default','Once you have defined a field, you can reuse it. For example, if you define a custom image field for one content type, and you need to have an image field with the same parameters on another content type, you can add the same field to the second content type, in the <em>Add existing field</em> area of the user interface. You could also add this field to a taxonomy vocabulary, comments, user accounts, etc.','','7.16'),(5276,'','default','Some settings of a reused field are unique to each use of the field; others are shared across all places you use the field. For example, the label of a text field is unique to each use, while the setting for the number of values is shared.','','7.16'),(5277,'','default','There are two main reasons for reusing fields. First, reusing fields can save you time over defining new fields. Second, reusing fields also allows you to display, filter, group, and sort content together by field across content types. For example, the contributed Views module allows you to create lists and tables of content. So if you use the same field on multiple content types, you can create a View containing all of those content types together displaying that field, sorted by that field, and/or filtered by that field.','','7.16'),(5278,'','default','Fields on content items','','7.16'),(5279,'','default','Fields on content items are defined at the content-type level, on the <em>Manage fields</em> tab of the content type edit page (which you can reach from the <a href=\"@types\">Content types page</a>). When you define a field for a content type, each content item of that type will have that field added to it. Some fields, such as the Title and Body, are provided for you when you create a content type, or are provided on content types created by your installation profile.','','7.16'),(5280,'','default','Fields on taxonomy terms','','7.16'),(5281,'','default','Fields on taxonomy terms are defined at the taxonomy vocabulary level, on the <em>Manage fields</em> tab of the vocabulary edit page (which you can reach from the <a href=\"@taxonomy\">Taxonomy page</a>). When you define a field for a vocabulary, each term in that vocabulary will have that field added to it. For example, you could define an image field for a vocabulary to store an icon with each term.','','7.16'),(5282,'','default','Fields on user accounts','','7.16'),(5283,'','default','Fields on user accounts are defined on a site-wide basis on the <a href=\"@fields\">Manage fields tab</a> of the <a href=\"@accounts\">Account settings</a> page. When you define a field for user accounts, each user account will have that field added to it. For example, you could add a long text field to allow users to include a biography.','','7.16'),(5284,'','default','Fields on comments','','7.16'),(5285,'','default','Fields on comments are defined at the content-type level, on the <em>Comment fields</em> tab of the content type edit page (which you can reach from the <a href=\"@types\">Content types page</a>). When you add a field for comments, each comment on a content item of that type will have that field added to it. For example, you could add a website field to the comments on forum posts, to allow forum commenters to add a link to their website.','','7.16'),(5286,'','default','Administer text formats and filters','','7.16'),(5287,'','default','Add new %type','','none'),(5288,'','default','The new set is created by copying items from your default shortcut set.','','none'),(5289,'','default','The new set is created by copying items from the %default set.','','none'),(5290,'','default','You are currently using the %set-name shortcut set.','','none'),(5291,'','default','edit set name','','none'),(5292,'','default','delete set','','none'),(5293,'','default','Create new set','','none'),(5294,'','default','The %set_name shortcut set has been created. You can edit it from this page.','','none'),(5295,'','default','Updated set name to %set-name.','','none'),(5296,'','default','If you have chosen this shortcut set as the default for some or all users, they may also be affected by deleting it.','','none'),(5297,'','default','Are you sure you want to delete the shortcut set %title?','','none'),(5298,'','default','The shortcut set %title has been deleted.','','none'),(5299,'','default','1 user has chosen or been assigned to this shortcut set.','','none'),(5300,'','default','@count users have chosen or been assigned to this shortcut set.','','none'),(5301,'','default','The Shortcut module allows users to create sets of <em>shortcut</em> links to commonly-visited pages of the site. Shortcuts are contained within <em>sets</em>. Each user with <em>Select any shortcut set</em> permission can select a shortcut set created by anyone at the site. For more information, see the online handbook entry for <a href=\"@shortcut\">Shortcut module</a>.','','7.16'),(5302,'','default','Administering shortcuts','','7.16'),(5303,'','default','Users with the <em>Administer shortcuts</em> permission can manage shortcut sets and edit the shortcuts within sets from the <a href=\"@shortcuts\">Shortcuts administration page</a>.','','7.16'),(5304,'','default','Choosing shortcut sets','','7.16'),(5305,'','default','Users with permission to switch shortcut sets can choose a shortcut set to use from the Shortcuts tab of their user account page.','','7.16'),(5306,'','default','The Shortcut module creates an add/remove link for each page on your site; the link lets you add or remove the current page from the currently-enabled set of shortcuts (if your theme displays it and you have permission to edit your shortcut set). The core Seven administration theme displays this link next to the page title, as a small + or - sign. If you click on the + sign, you will add that page to your preferred set of shortcuts. If the page is already part of your shortcut set, the link will be a - sign, and will allow you to remove the current page from your shortcut set.','','7.16'),(5307,'','default','Define which shortcut set you are using on the <a href=\"@shortcut-link\">Shortcuts tab</a> of your account page.','','none'),(5308,'','default','Edit current shortcut set','','7.16'),(5309,'','default','Editing the current shortcut set will affect other users if that set has been assigned to or selected by other users. Granting \"Select any shortcut set\" permission along with this permission will grant permission to edit any shortcut set.','','7.16'),(5310,'','default','Select any shortcut set','','7.16'),(5311,'','default','From all shortcut sets, select one to be own active set. Without this permission, an administrator selects shortcut sets for users.','','7.16'),(5312,'','default','Add shortcut set','','7.16'),(5313,'','default','Edit set name','','none'),(5314,'','default','Delete shortcut set','','none'),(5315,'','default','@remote could not be saved to @path.','','none'),(5316,'','default','Drupal requires you to enable the PHP extensions in the following list (see the <a href=\"@system_requirements\">system requirements page</a> for more information):','','none'),(5317,'','default','Database support','','none'),(5318,'','default','Your web server does not appear to support any common PDO database extensions. Check with your hosting provider to see if they support PDO (PHP Data Objects) and offer any databases that <a href=\"@drupal-databases\">Drupal supports</a>.','','none'),(5319,'','default','theme() may not be called until all modules are loaded.','','none'),(5320,'','default','The date the comment was most recently updated.','','7.16'),(5321,'','default','Comment posted: %subject.','','none'),(5322,'','default','On value','','none'),(5323,'','default','If left empty, \"1\" will be used.','','none'),(5324,'','default','Off value','','none'),(5325,'','default','If left empty, \"0\" will be used.','','none'),(5326,'','default','This field has been disabled because you do not have sufficient permissions to edit it.','','none'),(5327,'','default','Select a forum.','','none'),(5328,'','default','The GD Library for PHP is enabled, but was compiled without support for functions used by the rotate and desaturate effects. It was probably compiled using the official GD libraries from http://www.libgd.org instead of the GD library bundled with PHP. You should recompile PHP --with-gd using the bundled GD library. See <a href=\"http://www.php.net/manual/book.image.php\">the PHP manual</a>.','','none'),(5329,'','default','View, edit and delete all content regardless of permission restrictions.','','7.16'),(5330,'','default','You must validate your email address for this account before logging in via OpenID.','','none'),(5331,'','default','The HTML ID %id is unique.','','none'),(5332,'','default','Syslog format','','none'),(5333,'','default','Specify the format of the syslog entry. Available variables are: <dl><dt><code>!base_url</code></dt><dd>Base URL of the site.</dd><dt><code>!timestamp</code></dt><dd>Unix timestamp of the log entry.</dd><dt><code>!type</code></dt><dd>The category to which this message belongs.</dd><dt><code>!ip</code></dt><dd>IP address of the user triggering the message.</dd><dt><code>!request_uri</code></dt><dd>The requested URI.</dd><dt><code>!referer</code></dt><dd>HTTP Referer if available.</dd><dt><code>!uid</code></dt><dd>User ID.</dd><dt><code>!link</code></dt><dd>A link to associate with the message.</dd><dt><code>!message</code></dt><dd>The message to store in the log.</dd></dl>','','none'),(5334,'','default','A date in \'time-since\' format. (%date)','','7.16'),(5335,'','default','The location of the file relative to Drupal root.','','7.16'),(5336,'','default','HTTP error @errorcode occurred when trying to fetch @remote.','','none'),(5337,'','default','Your system or network configuration does not allow Drupal to access web pages, resulting in reduced functionality. This could be due to your webserver configuration or PHP settings, and should be resolved in order to download information about available updates, fetch aggregator feeds, sign in via OpenID, or use other network-dependent services. If you are certain that Drupal can access web pages but you are still seeing this message, you may add <code>$conf[\'drupal_http_request_fails\'] = FALSE;</code> to the bottom of your settings.php file.','','none'),(5338,'','default','A translation of %title in %language already exists, a new %type will be created instead of a translation.','','none'),(5339,'','default','Your modules have been downloaded and updated.','','none'),(5340,'','default','<a href=\"@update\">Run database updates</a>','','none'),(5341,'','default','@name <em>(locked)</em>','','7.16'),(5342,'','default','Are you sure you want to delete the role %name ?','','none'),(5343,'','default','Permissions let you control what users can do and see on your site. You can define a specific set of permissions for each role. (See the <a href=\"@role\">Roles</a> page to create a role). Two important roles to consider are Authenticated Users and Administrators. Any permissions granted to the Authenticated Users role will be given to any user who can log into your site. You can make any role the Administrator role for the site, meaning this will be granted all new permissions automatically. You can do this on the <a href=\"@settings\">User Settings</a> page. You should be careful to ensure that only trusted users are given this access and level of control of your site.','','7.16'),(5344,'','default','Roles allow you to fine tune the security and administration of Drupal. A role defines a group of users that have certain privileges as defined on the <a href=\"@permissions\">permissions page</a>. Examples of roles include: anonymous user, authenticated user, moderator, administrator and so on. In this area you will define the names and order of the roles on your site. It is recommended to order your roles from least permissive (anonymous user) to most permissive (administrator). To delete a role choose \"edit role\".','','7.16'),(5345,'','default','Use <em>articles</em> for time-sensitive content like news, press releases or blog posts.','','7.16'),(5346,'; modules/file/file.js','default','The selected file %filename cannot be uploaded. Only files with the following extensions are allowed: %extensions.','','none'),(5347,'','default','Bartik','','7.16'),(5348,'','default','A flexible, recolorable theme with many regions.','','none'),(5349,'','default','Main background','','none'),(5350,'','default','Sidebar background','','none'),(5351,'','default','Sidebar borders','','none'),(5352,'','default','Footer background','','none'),(5353,'','default','Plum','','none'),(5354,'','default','A space-separated list of HTML tags allowed in the content of feed items. Disallowed tags are stripped from the content.','','none'),(5355,'','default','%field may only contain characters a-z, underscores, or hyphens.','','none'),(5356,'','default','%field cannot contain any markup.','','none'),(5357,'','default','No URL aliases available. <a href=\"@link\">Add URL alias</a>.','','none'),(5358,'','default','To provide keyword searching, the search engine maintains an index of words found in the content and its fields, along with text added to your content by other modules (such as comments from the core Comment module, and taxonomy terms from the core Taxonomy module). To build and maintain this index, a correctly configured <a href=\"@cron\">cron maintenance task</a> is required. Users with <em>Administer search</em> permission can further configure the cron settings on the <a href=\"@searchsettings\">Search settings page</a>.','','7.16'),(5359,'','default','Content reindexing','','7.16'),(5360,'','default','Content-related actions on your site (creating, editing, or deleting content and comments) automatically cause affected content items to be marked for indexing or reindexing at the next cron run. When content is marked for reindexing, the previous content remains in the index until cron runs, at which time it is replaced by the new content. Unlike content-related actions, actions related to the structure of your site do not cause affected content to be marked for reindexing. Examples of structure-related actions that affect content include deleting or editing taxonomy terms, enabling or disabling modules that add text to content (such as Taxonomy, Comment, and field-providing modules), and modifying the fields or display parameters of your content types. If you take one of these actions and you want to ensure that the search index is updated to reflect your changed site structure, you can mark all content for reindexing by clicking the \"Re-index site\" button on the <a href=\"@searchsettings\">Search settings page</a>. If you have a lot of content on your site, it may take several cron runs for the content to be reindexed.','','7.16'),(5361,'','default','These options control the display settings for the %name theme. When your site is displayed using this theme, these settings will be used.','','none'),(5362,'','default','Administer software updates','','7.16'),(5363,'','default','Enter a valid email address or use a token e-mail address such as %author.','','none'),(5364,'','default','@required_name (Missing)','','none'),(5365,'','default','@required_name (Version @compatibility required)','','none'),(5366,'','default','@name requires at least PHP @version.','','none'),(5367,'','default','Unresolved dependency','','none'),(5368,'','default','@name requires this module.','','none'),(5369,'','default','@name requires this module and version. Currently using @required_name version @version','','none'),(5370,'','default','Site details','','7.16'),(5371,'','default','Title and slogan','','none'),(5372,'','default','Firehouse','','none'),(5373,'','default','Ice','','none'),(5374,'','default','Can\'t handle more than one field storage engine','','none'),(5375,'','default','Field storage engine not found.','','none'),(5376,'','default','For this query an entity type must be specified.','','none'),(5377,'','default','Entity %entity has no base table.','','none'),(5378,'','default','Do not know how to order on @key for @entity_type','','none'),(5379,'','default','The database table prefix you have entered, %prefix, is invalid. The table prefix can only contain alphanumeric characters, periods, or underscores.','','none'),(5380,'','default','Default settings file','','none'),(5381,'','default','The default settings file