d that makes it easy to create a simple date content type with a date field. ','','7.16'),(6448,'/sartori_b1/admin/help?render=overlay','default','Complete documentation for the Date and Date API modules is available at <a href=\"@link\">http://drupal.org/node/92460</a>.','','7.16'),(6449,'/sartori_b1/admin/help?render=overlay','default','Provides a mechanism for modules to automatically generate aliases for the content they manage.','','7.16'),(6450,'/sartori_b1/admin/help?render=overlay','default','Maximum alias and component length','','7.16'),(6451,'/sartori_b1/admin/help?render=overlay','default','The <strong>maximum alias length</strong> and <strong>maximum component length</strong> values default to 100 and have a limit of @max from Pathauto. This length is limited by the length of the \"alias\" column of the url_alias database table. The default database schema for this column is @max. If you set a length that is equal to that of the one set in the \"alias\" column it will cause problems in situations where the system needs to append additional words to the aliased URL. You should enter a value that is the length of the \"alias\" column minus the length of any strings that might get added to the end of the URL. The length of strings that might get added to the end of your URLs depends on which modules you have enabled and on your Pathauto settings. The recommended and default value is 100.','','7.16'),(6452,'/sartori_b1/admin/help?render=overlay','default','The administration menu module provides a dropdown menu arranged for one- or two-click access to most administrative tasks and other common destinations (to users with the proper permissions). Administration menu also displays the number of anonymous and authenticated users, and allows modules to add their own custom menu items. Integration with the menu varies from module to module; the contributed module <a href=\"@drupal\">Devel</a>, for instance, makes strong use of the administration menu module to provide quick access to development tools.','','7.16'),(6453,'/sartori_b1/admin/help?render=overlay','default','The administration menu <a href=\"@settings\">settings page</a> allows you to modify some elements of the menu\'s behavior and appearance. Since the appearance of the menu is dependent on your site theme, substantial customizations require modifications to your site\'s theme and CSS files. See the advanced module README.txt file for more information on theme and CSS customizations.','','7.16'),(6454,'/sartori_b1/admin/help?render=overlay','default','The menu items displayed in the administration menu depend upon the actual permissions of the viewer. First, the administration menu is only displayed to users in roles with the <em>Access administration menu</em> (admin_menu module) permission. Second, a user must be a member of a role with the <em>Access administration pages</em> (system module) permission to view administrative links. And, third, only currently permitted links are displayed; for example, if a user is not a member of a role with the permissions <em>Administer permissions</em> (user module) and <em>Administer users</em> (user module), the <em>User management</em> menu item is not displayed.','','7.16'),(6455,'/sartori_b1/admin/people/permissions/4?render=overlay','default','Use PHP for title patterns','','7.16'),(6456,'/sartori_b1/admin/people/permissions/4?render=overlay','default','Use PHP for title patterns.','','7.16'),(6457,'/sartori_b1/admin/people?render=overlay','default','delete own andamento_processual content','','7.16'),(6458,'/sartori_b1/admin/people?render=overlay','default','delete any andamento_processual content','','7.16'),(6459,'/sartori_b1/admin/people?render=overlay','default','create andamento_processual content','','7.16'),(6460,'/sartori_b1/admin/people?render=overlay','default','edit own andamento_processual content','','7.16'),(6461,'/sartori_b1/admin/people?render=overlay','default','edit any andamento_processual cont