 regiões. Para mais informações, veja a documentação online para o <a href=\"@block\">módulo Block</a>.','pt-br',0,0),(4068,'Posicionando conteúdo','pt-br',0,0),(4069,'Quando se lida com blocos, lembre-se que nem todos os temas utilizam as mesmas regiões ou regiões de displays da mesma maneira. Blocos são posicionados diferentemente em cada tema, diferindo entre si. Usuários que possuam permissão de <em>Administrar blocos</em> podem desativá-los. Blocos inativos são listados na <a href=\"@blocks\">Página de administração de blocos</a>, mas não são exibidos em nenhuma região.','pt-br',0,0),(4070,'Controlando visibilidade','pt-br',0,0),(4071,'Blocos podem ser configurados para serem exibidos em determinadas páginas, apenas para determinados papéis ou ainda serem exibidos em determinados <a href=\"@content-type\">tipos de conteúdo</a>. Administradores podem também permitir que blocos específicos sejam ativados e desativados por usuários quando estes editarem a página <a href=\"@user\">Minha conta</a>. Alguns blocos dinâmicos, como aquels gerados por módulos, serão exibidos apenas em determinadas páginas.','pt-br',0,0),(4072,'Criando blocos personalizados','pt-br',0,0),(4073,'Usuários com permissão para <em>Administrar blocos</em> podem <a href=\"@block-add\">adicionar blocos personalizados</a>, que serão, então, listados na <a href=\"@blocks\">Página de administração de blocos</a>. Uma vez criados, blocos personalizados tem o mesmo comportamento que os blocos gerados pelos módulos.','pt-br',0,0),(4074,'Esta página possui uma interface de arrastar e soltar para atribuir um bloco a uma região e para controlar a ordem dos blocos dentro das regiões. Como nem todos os temas implementam as mesmas regiões, ou exibem regiões da mesma maneira, os blocos são posicionados com base em cada tema. Lembre-se que suas alterações não serão salvas até que você clique no botão <em>Salvar blocos</em> no final da página. Clique no link <em>configurar</em> próximo a cada bloco para configurar seu título e configurações de visibilidade específicas.','pt-br',0,0),(4075,'Demonstrar as regiões de blocos (@theme)','pt-br',0,0),(4076,'Administrar blocos','pt-br',0,0),(4077,'Uma breve descrição de seu bloco. Usada na <a href=\"@overview\">página de administração de blocos</a>.','pt-br',0,0),(4078,'Personalizar blocos','pt-br',0,0),(4079,'Blocos consistem em conteúdo ou informação que complementa o conteúdo principal de uma página. Ative ou desative blocos opcionais usando as caixas de seleção abaixo.','pt-br',0,0),(4080,'O cache de blocos está inativo porque você tem módulos ativos que estão definindo restrições de acesso a conteúdo.','pt-br',0,0),(4081,'Controla a construção visual de blocos que compõem uma página. Blocos são caixas de conteúdo exibidas numa área, ou região, de uma página.','pt-br',0,0),(4082,'Restrito para certas páginas','pt-br',0,0),(4083,'O bloco não pode ser colocado nessa região.','pt-br',0,0),(4084,'Use para blogs multi-usuários. Cada usuário tem um blog pessoal.','pt-br',0,0),(4085,'Blogs de usuário único','pt-br',0,0),(4086,'Cada post de um blog é exibido automaticamente com um link para a página principal do blog do usuário. Você pode criar um blog para cada usuário com permissão de criar conteúdo de blog.','pt-br',0,0),(4087,'Blogs multi-usuário','pt-br',0,0),(4088,'Posts de blogs de cada usuário são agregados em um blog multi-usuário central, que exibe o conteúdo do blog de todos os usuários em uma única lista.','pt-br',0,0),(4089,'Existe um item de menu opcional chamado <em>Blogs</em> adicionado ao Menu de Navegação, que exibe todos os blogs disponíveis no seu site, e um item <em>Meu blog</em> que mostra os posts do usuário atual.','pt-br',0,0),(4090,'O módulo Blog também cria um bloco padrão <em>Postagens Recentes</em> que pode ser habilitado na <a href=\"@blocks\">página de administração de blocos</a>.','pt-br',0,0),(4091,'Criar nova entrada no blog','pt-br',0,0),(4092,'Permite blogs multi-usuário.','pt-br',0,0),(4093,'Não há livros disponíveis.','pt-br',0,0),(4094,'Tipos de conteúdo permitidos nos esboços do livro','pt-br',0,0),(4095,'Usuários com a permissão %outline-perm podem adicionar todos os tipos de conteúdo.','pt-br',0,0),(4096,'Administrar esboços do livro','pt-br',0,0),(4097,'O módulo Book é usado para criar textos estruturados e de várias páginas, como guias, manuais e wikis. Ele permite que um documento tenha capítulos, seções, subseções, ou qualquer estrutura similar em camadas. Para mais informações, consulte a documentação online do <a href=\"@book\">módulo Book</a>.','pt-br',0,0),(4098,'Acrescentando e manipulando o conteúdo do livro','pt-br',0,0),(4099,'Você pode atribuir permissões separadas para <em>criar</em>, <em>editar</em>, e <em>apagar</em> conteúdo de livros, bem como <em>adicionar conteúdo a livros</em>, e <em>criar novos livros</em>. Os usuários com a permissão de <em>Administrar estrutura de livros</em> podem adicionar <em>qualquer</em> tipo de conteúdo a um livro selecionando a estrutura de livro apropriada ao editar um conteúdo. Eles também podem ver uma lista de todos os livros, e editar e rearranjar os títulos da seção na página de <a href=\"@admin-book\">administração de livro</a>.','pt-br',0,0),(4100,'Páginas de livro tem um bloco de navegação específico para livros. Este bloco de navegação contem links que levam às próximas páginas, bem como as anteriores e ao nível acima na estrutura de livro. Este bloco pode ser ativado na <a href=\'@admin-block\'>Página de administração de blocos</a>. Para que páginas de livro apareçam no bloco de navegação, elas precisam ser adicionadas a um esboço de livro.','pt-br',0,0),(4101,'Livros podem ser criados colaborativamente já que permitem que usuários com as permissões apropriadas adicionem páginas a livros já existentes e adiciona estas páginas a um menu personalizado com o índice do conteúdo.','pt-br',0,0),(4102,'Imprimindo livros','pt-br',0,0),(4103,'Usuários com a permissão de <em>Ver livros em versão para impressão</em> podem selecionar o link <em>versão para impressão</em> na base do conteúdo de uma página de livro para gerar uma exibição para impressão da página e de todas as suas subseções.','pt-br',0,0),(4104,'O módulo livro oferece um meio de organizar uma coleção de páginas de conteúdo relacionado, coletivamente conhecida como um livro. Quando visto, este conteúdo irá automaticamente exibir links para as páginas de livros adjacentes, fornecendo um sistema simples de navegação para criar e revisar conteúdo estruturado.','pt-br',0,0),(4105,'A funcionalidade de outline permite você que inclua páginas em uma <a href=\"@book\">hierarquia de livro</a> além de reorganizá-las dentro da hierarquia ou <a href=\"@book-admin\">reordenar o livro inteiro</a>.','pt-br',0,0),(4106,'Criar novos livros','pt-br',0,0),(4107,'Adicionar conteúdo e páginas filhas a livros','pt-br',0,0),(4108,'Exibir livros para impressão','pt-br',0,0),(4109,'Ver uma página de livro e todas as suas sub-páginas como um único documento para facilitar a impressão. Pode afetar o desempenho.','pt-br',0,0),(4110,'<em>Livros</em> possuem uma navegação hierárquica interna. Use para manuais ou tutoriais.','pt-br',0,0),(4111,'Permite que os usuários criem e organizem conteúdo relacionado em uma estrutura.','pt-br',0,0),(4112,'O módulo Color permite que os usuários com a permissão para <em>Configuração da Administração do Site</em> mudem o esquema de cores de temas compatíveis. Para obter mais informações, consulte a ajuda online para o <a href=\"@color\">módulo Color </a>.','pt-br',0,0),(4113,'Alterando cores','pt-br',0,0),(4114,'Utilizar o módulo Color permite facilmente mudar a cor dos links, fundos, texto e outros elementos do tema. Para alterar as configurações de cor para um tema compatível, selecione o link <em>Configurações</em> para o seu tema na <a href=\'@configure\'>Página de administração de Temas</a>. Se você não ver um seletor de cores nessa página, então seu o tema não é compatível com o módulo Color. Se você tem certeza que o tema realmente suporta o módulo Color, mas o seletor de cores não aparece, então <a href=\'@troubleshoot\'>siga estes procedimentos para solução de problemas</a>.','pt-br',0,0),(4115,'O módulo de cor salva uma cópia modificada do tema especificado no diretório de arquivos de folhas de estilo. Isso significa que se você fizer algumas alterações manuais de estilo do seu tema, <em>você deverá salvar as suas definições de cores novamente, mesmo que eles não tenham mudado</em>. Este passo é requirido porque o módulo de folhas de estilo (no diretório de arquivos) precisaser recriado para incluir as suas alterações.','pt-br',0,0),(4116,'A biblioteca GD para PHP está ativada, mas foi compilada sem suporte ao formato PNG. Verifique a <a href=\" @url \">documentação de imagens PHP</a> para informações sobre como corrigir isto.','pt-br',0,0),(4117,'A biblioteca GD para PHP está em falta ou desatualizada. Verifique a <a href=\"@url\">documentação de imagens PHP</a> para informações sobre como corrigir isto.','pt-br',0,0),(4118,'Permite que administradores alterem o esquema de cores de temas compatíveis.','pt-br',0,0),(4119,'Selecione um ou mais comentários para executar a atualização.','pt-br',0,0),(4120,'Aparentemente não existe nenhum comentário para excluir, ou o comentário selecionado foi excluído por outro administrador.','pt-br',0,0),(4121,'@count comentários apagados.','pt-br',0,0),(4122,'Apagado o comentário @cid e suas respostas.','pt-br',0,0),(4123,'Comentário aprovado.','pt-br',0,0),(4124,'Tokens para comentários publicados no site.','pt-br',0,0),(4125,'O Módulo Comment permite aos usuários comentar o conteúdo do site, definir padrões e permissões dos comentários, e moderar comentários. Para mais informações, consulte o manual on-line para o <a href=\"@comment\">Módulo Comment</a>.','pt-br',0,0),(4126,'Configurações padrão e personalizadas','pt-br',0,0),(4127,'Cada <a href=\'@content-type\'>tipo de conteúdo</a> pode ter as suas próprias configurações padrão de comentário como: <em>Aberto</em> para permitir novos comentários, <em>Oculto</em> para ocultar os comentários existentes e impedir novos comentários, ou <em>Fechado</em> para ver os comentários existentes, mas impedir novos comentários. Estes padrões serão aplicados a todos os novos conteúdos criados (mudanças nas configurações no conteúdo existente devem ser feitas manualmente). Outras configurações de comentários também podem ser editadas por tipo de conteúdo, e podem ser sobrescritas para qualquer item de conteúdo. Enquanto um comentário não tem qualquer resposta, ele permanece editável por seu autor, desde que o autor tenha uma conta de usuário e esteja autenticado.','pt-br',0,0),(4128,'Comentários rejeitados (@count)','pt-br',0,0),(4129,'Administrar comentários e configurações de comentários','pt-br',0,0),(4130,'Editar os próprios comentários','pt-br',0,0),(4131,'Quantidade de comentários recentes','pt-br',0,0),(4132,'Encadeamento','pt-br',0,0),(4133,'Mostrar respostas a comentários em uma lista encadeada.','pt-br',0,0),(4134,'Configuração padrão de comentários para novo conteúdo','pt-br',0,0),(4135,'Permitir título de comentários','pt-br',0,0),(4136,'Mostrar formulário de resposta na mesma página dos comentários','pt-br',0,0),(4137,'Usuários com a permissão \"Postar comentários\" podem postar comentários.','pt-br',0,0),(4138,'Usuários não podem postar comentários, mas os comentários existentes serão exibidos.','pt-br',0,0),(4139,'Comentários são escondidos.','pt-br',0,0),(4140,'Usuários não podem postar comentários.','pt-br',0,0),(4141,'Seu comentário está aguardando uma verificação dos administradores e será publicado após aprovação.','pt-br',0,0),(4142,'Seu comentário foi enviado.','pt-br',0,0),(4143,'<a href=\"@login\">Login</a> ou <a href=\"@register\">registre-se</a> para postar comentários','pt-br',0,0),(4144,'<a href=\"@login\">Login</a> para postar comentários','pt-br',0,0),(4145,'Lista corrida','pt-br',0,0),(4146,'Lista encadeada','pt-br',0,0),(4147,'O comentário será despublicado caso contenha alguma das frases acima. Use frases sensíveis à capitalização, em uma lista separada por vírgulas. Exemplo: engraçado, bungee jumping ,\"Companhia, SA.\"','pt-br',0,0),(4148,'O comentário %subject foi publicado.','pt-br',0,0),(4149,'Comentário %title salvo','pt-br',0,0),(4150,'Listar e editar os comentários e a fila de aprovação de comentários.','pt-br',0,0),(4151,'Comentários não aprovados','pt-br',0,0),(4152,'Exemplo: \'webmaster@exemplo.com.br\' ou \'vendas@exemplo.com.br,suporte@exemplo.com.br\'. Para especificar vários destinatários, separe os endereços com vírgula.','pt-br',0,0),(4153,'A categoria %category foi salva.','pt-br',0,0),(4154,'Você não pode enviar mais do que %limit mensagens em @interval. Por favor, ente novamente mais tarde.','pt-br',0,0),(4155,'Contatar @username','pt-br',0,0),(4156,'%sender-name (@sender-from) enviou um email sobre %category','pt-br',0,0),(4157,'%sender-name (@sender-from) enviado para um email %recipient-name.','pt-br',0,0),(4158,'O módulo Contact permite que os visitantes contatem os administradores do site e outros usuários. Usuários especificam um assunto, escrevem sua mensagem, e podem ter uma cópia de sua mensagem enviada ao seu próprio endereço de email. Para mais informações, consulte a ajuda online do <a href=\"@contact\">módulo Contact</a>.','pt-br',0,0),(4159,'Formulários de contato dos usuários','pt-br',0,0),(4160,'Os usuários do site podem ser contatados com um formulário de contato que mantém seu endereço de email privado. Os usuários podem habilitar ou desabilitar seus formulários de contato pessoal editando a página <em>Minha conta</em>. Se ativada, uma aba <em>Contato</em> leva a um formulário de contato pessoal exibido em seu perfil de usuário. Os administradores do site ainda são capazes de usar o formulário de contato, mesmo que tenha sido desativado. A aba <em>Contato</em> não é mostrada quando você vê seu próprio perfil.','pt-br',0,0),(4161,'Formulários de contato do site','pt-br',0,0),(4162,'A <a href=\"@contact\">página de Contatos</a> fornece um formulário simples para os usuários com a permissão <em>Usar o formulário de contato</em> enviarem comentários, sugestões, ou outras requisições. Você pode criar categorias para direcionar as mensagens dos formulários de contato para destinatários definidos. Categorias comuns para um site de negócios, por exemplo, pode ter \"Dúvidas\" ou \"Sugestões\" (mensagens são encaminhadas para para os administradores do site) e \"Informações de produto\" (mensagens são encaminhadas para membros do departamento de vendas). Os endereços de email em uma categoria não são exibidos publicamente.','pt-br',0,0),(4163,'Quando o formulário de contato de todo o site for ativado, um link no menu de <em>Navegação</em> principal é criado, mas o link está desativado por padrão. Este link do menu poderá ser ativado na <a href=\'@menu\'>página de administração de Menu</a>.','pt-br',0,0),(4164,'Customização','pt-br',0,0),(4165,'Se você gostaria que o texto adicional aparecesse em todo site ou napágina de contato pessoal, usando um bloco. Você poderá criar e editar blocos na <a href=\"@blocks\"> Página de administração de Blocos </a>.','pt-br',0,0),(4166,'Adicione uma ou mais categorias a essa página para configurar um <a href=\"@form\">formulário de contato</a> do site.','pt-br',0,0),(4167,'Um item do menu de <em>Contato</em> (desativado por padrão) é adicionado ao menu de navegação, que você poderá modificar na <a href=\"@menu-settings\">Página de administração de menus</a>.','pt-br',0,0),(4168,'Se você quer que um texto adicional apareça na página de contato do site, use um bloco. Você pode criar e editar blocos na <a href=\"@blocos\">Página de administração de blocos</a>.','pt-br',0,0),(4169,'Administrar formulários de contato e suas configurações','pt-br',0,0),(4170,'Usar o formulário de contato do site','pt-br',0,0),(4171,'Usar os formulários de contatos pessoais dos usuários','pt-br',0,0),(4172,'!sender-name (!sender-url) enviou uma mensagem usando o formulário de contato em !form-url.','pt-br',0,0),(4173,'[!site-name] !subject','pt-br',0,0),(4174,'!sender-name (!sender-url) lhe enviou uma mensagem através do seu formulário de contato (!form-url) em !site-name.','pt-br',0,0),(4175,'Se você não deseja receber tais e-mails, você pode mudar as suas definições em !recipient-edit-url.','pt-br',0,0),(4176,'Permite aos outros usuários contatarem você pelo <a href=\"@url\">formulário de contato pessoal</a> que mantém seu endereço de e-mail oculto. Note que alguns usuários privilegiados, como os administradores do site, ainda serão capazes de contatar você mesmo que desabilite este recurso.','pt-br',0,0),(4177,'Habilitar o formulário de contato pessoal por padrão para novos usuários.','pt-br',0,0),(4178,'Mudar esta configuração não afetará usuários existentes.','pt-br',0,0),(4179,'O módulo de Links contextuais exibe links relacionados a regiões de páginas do seu site à usuários com permissão de <em>acessar links contextuais<em>. Para mais informações, consulte o a seção do manual sobre o <a href=\"@contextual\">módulo Links contextuais</a>.','pt-br',0,0),(4180,'Exibindo links contextuais','pt-br',0,0),(4181,'Links contextuais são disponibilizados por módulos para criar acesso rápido a tarefas associadas com regiões de páginas no seu site. Por exemplo, se você tem um bloco de menu personalizado na barra lateral do seu site, os módulos Blocos e Menus vão disponibilizar links para configurar o bloco e editar o menu. O módulo de Links Contextuais junta esses links numa lista para ser exibida no seu tema, além de adicionar código JavaScript para esconder os links até que você passe o mouse por cima do bloco.','pt-br',0,0),(4182,'Usar links contextuais','pt-br',0,0),(4183,'Usar links contextuais para executar ações relacionadas a elementos em uma página.','pt-br',0,0),(4184,'Links contextuais','pt-br',0,0),(4185,'Provê links contextuais para executar açõ