e define um tipo de campo de <em>Arquivo</em> para o módulo Field, que permite gerenciar e validar arquivos anexados ao conteúdo do seu site (visite a <a href=\"@field-help\">Página de ajuda do módulo Field</a> para mais informações sobre os campos). Para maiores informações, veja esta página do handbook online do <a href=\"@file\">módulo File</a>.','pt-br',0,0),(4292,'Anexando arquivos ao conteúdo','pt-br',0,0),(4293,'O módulo File permite que usuários anexem arquivos à conteúdos (ex. PDF, planilhas, imagens, etc.), quando um campo <em>Arquivo</em> é adicionado a um certo tipo de conteúdo usando o <a href=\"@fieldui-help\">módulo Field UI</a>. Você pode adicionar opções de validação para seu campo Arquivo, como especificar o tamanho máximo e as extensões permitidas.','pt-br',0,0),(4294,'Gerenciar exibição de anexos','pt-br',0,0),(4295,'Quando você anexa um arquivo ao conteúdo, você pode especificar quando ele será <em>listado</em> ou não. Arquivos listados são apresentados automaticamente em uma sessão abaixo do seu conteúdo; arquivos não listados estão disponíveis para serem embutidos no seu conteúdo, mas eles não são listados abaixo.','pt-br',0,0),(4296,'Gerenciando locais dos arquivos','pt-br',0,0),(4297,'Quando você cria um campo do tipo Arquivo, você pode especificar o diretório onde os arquivos serão gravados, que pode ser nos diretórios <em>público</em> ou <em>privado</em>. Arquivos no diretório público podem ser acessados diretamente pelo servidor web; quando arquivos públicos são listados, links diretos aos arquivos são usados, e qualquer um que sabe a URL do arquivo pode baixá-lo. Arquivos no diretório privado não são acessíveis diretamente pelo servidor web; quando arquivos privados são listados, os links são requisições do Drupal. Isto adiciona um tempo de carga maior, já que o Drupal precisa iniciar e resolver o caminho para cada requisição de download, mas permite restrições de acesso.','pt-br',0,0),(4298,'Ocorreu um erro irrecuperável. O uso deste formulário expirou. Tente recarregar a página e enviar novamente.','pt-br',0,0),(4299,'O arquivo referenciado pelo campo !name não existe.','pt-br',0,0),(4300,'O arquivo no campo !name não pôde ser enviado.','pt-br',0,0),(4301,'O diretório de upload %directory para o campo File !name, não pôde ser criado ou não está acessível. Em consequência o arquivo enviado não pôde ser salvo no diretório e foi cancelado.','pt-br',0,0),(4302,'O servidor não é capaz de mostrar o progresso do upload de arquivos. O progresso do upload de arquivos requer um servidor Apache rodando PHP com mod_php.','pt-br',0,0),(4303,'Todos os papéis de usuário podem usar esse formato','pt-br',0,0),(4304,'A ordenação do formato do texto foi salva.','pt-br',0,0),(4305,'Adicionar formato de texto','pt-br',0,0),(4306,'Todos os papéis de usuários para esse formato de texto devem ser habilitados e não podem ser mudados.','pt-br',0,0),(4307,'Ordem de processamento do filtro','pt-br',0,0),(4308,'Os nomes dos formatos de texto devem ser exclusivos. Já existe um formato chamado %name.','pt-br',0,0),(4309,'Adicionado um formato de texto %format.','pt-br',0,0),(4310,'O formato de texto %format foi atualizado.','pt-br',0,0),(4311,'O módulo Filter permite aos administradores configurar os formatos de texto. O formato de texto define as tags HTML, códigos e outros valores permitidos em conteúdos e comentários. É um elemento-chave na proteção contra a entrada de dados potencialmente prejudiciais de usuários mal-intencionados. Para mais informações, visite o  guia de ajuda do <a href=\"@filter\">módulo Filter</a>.','pt-br',0,0),(4312,'Aplicando filtros ao texto','pt-br',0,0),(4313,'Cada formato de texto utiliza filtros para manipular texto digitado, e a maioria dos formatos aplicam vários filtros de texto em uma ordem específica. Cada filtro é projetado para uma finalidade específica e, em geral, tanto adiciona, remove como transforma os elementos do texto digitado pelo usuário antes que o texto seja exibido. Um filtro não altera o conteúdo real, mas em vez disso, modifica o temporariamente antes de ser exibido. Um filtro pode remover tags HTML não aprovadas, enquanto outro adiciona automaticamente HTML para exibir URLs como links clicáveis.','pt-br',0,0),(4314,'Definindo formatos de texto','pt-br',0,0),(4315,'Um formato é incluido por padrão: <em>Texto puro</em> (que remove todas as tags HTML). Formatos adicionais podem ser criados pelo seu perfil de instalação quando instalando o Drupal, e podem ainda ser criados por um administrador na <a href=\"@text-formats\">Página de formatos de texto</a>.','pt-br',0,0),(4316,'Escolhendo um formato de texto','pt-br',0,0),(4317,'Um formato de texto contém filtros que alteram a entrada do usuário, por exemplo, eliminando HTML malicioso ou tornando URLs clicáveis. Os filtros são executados de cima para baixo e a ordem é importante pois um filtro pode impedir outro filtro de realizar seu trabalho. Por exemplo, se URLs são convertidas em links antes de tags HTML proíbidas serem removidas, todos os links podem serão removidos. Quando isso acontece, a ordem dos filtros deve ser re-arranjada.','pt-br',0,0),(4318,'Aviso: Esta permissão pode ter implicações de segurança dependendo de como o formato de texto está configurado.','pt-br',0,0),(4319,'Usar o formato de texto !text_format','pt-br',0,0),(4320,'Mais informações sobre os formatos de texto','pt-br',0,0),(4321,'Limita as tags HTML permitidas','pt-br',0,0),(4322,'Converte quebras de linha em HTML (ex. <code>&lt;br&gt;</code> e <code>&lt;p&gt;</code>)','pt-br',0,0),(4323,'Converte URLs em links','pt-br',0,0),(4324,'Corrige HTML defeituoso e cortado','pt-br',0,0),(4325,'Exibe qualquer HTML como texto puro','pt-br',0,0),(4326,'Uma lista de tags HTML que podem ser usadas. Atributos de eventos JavaScript, URLs de JavaScript, e CSS são sempre removidos.','pt-br',0,0),(4327,'Exibir ajuda básica de HTML nas dicas de filtragem longas.','pt-br',0,0),(4328,'Adicionar rel=\"nofollow\" a todos os links.','p