ditar o conteúdo.','pt-br',0,0),(4440,'O módulo Image permite manipular imagens em seu website. Ele expõe configurações do <em>Toolkit de imagens</em>, permite configurar <em>Estilos de imagem</em> que podem ser usados para redimensionar ou ajustar a exibição de imagens e disponibiliza um campo <em>Imagem</em> para anexar imagens ao conteúdo. Para mais informações, consulte o manual online do <a href=\"@image\">módulo Image</a>.','pt-br',0,0),(4441,'Manipulando imagens','pt-br',0,0),(4442,'Com o módulo Image você pode escalar, cortar, redimensionar, girar e desaturar imagens sem afetar a imagem original usando <a href=\"@image\">estilos de imagens</a>. Quando você altera um estilo de imagem o módulo automaticamente atualiza todas as imagens criadas. Todos estilos de imagens devem ter um nome que será usado na URL das imagens geradas. Existem duas abordagens comuns ao nomear estilos de imagens (que você deve usar dependendo de como os estilos de imagem serão aplicados):','pt-br',0,0),(4443,'Baseado em onde isto será usado: ex. <em>imagem do perfil</em>','pt-br',0,0),(4444,'Descrevendo sua aparência: ex. <em>quadrado-85x85</em>','pt-br',0,0),(4445,'Anexando imagens ao conteúdo como campos','pt-br',0,0),(4446,'O módulo Image também permite adicionar campos de imagem ao conteúdo. Para adicionar um campo de imagem a um <a href=\"@content-type\">tipo de conteúdo</a>, acesse a página <em>gerenciar campos</em> do tipo de conteúdo, e adicione um novo campo do tipo <em>Imagem</em>. Anexar imagens ao conteúdo desta maneira permite que estilos de imagem sejam aplicados e mantidos, e também permite mais flexibilidade na criação de temas.','pt-br',0,0),(4447,'Estilos de imagens são usados normalmente para criar miniaturas redimensionando e cortando imagens, mas também podem adicionar vários efeitos antes de uma imagem ser exibida. Quando uma imagem é exibida com um estilo, um novo arquivo é criado e a imagem original é mantida intacta.','pt-br',0,0),(4448,'Administrar estilos de 