atas deste idioma serão removidos. Esta ação não pode ser desfeita.','pt-br',0,0),(4477,'O módulo Locale permite que seu site Drupal seja apresentado em idiomas diferentes do inglês, e torna-o multi-idiomas. O módulo Locale funciona mantendo um banco de dados de traduções, e examinando textos sempre que são apresentados. Quando a tradução do texto está disponível no idioma a ser apresentado, a tradução é exibida no lugar do texto original. Quando a tradução não estiver disponível, o texto original é mostrado, e então armazenado para ser revisado por um tradutor. Para mais informações, veja a entrada online no handbook <a href=\"@locale\">módulo Locale</a>.','pt-br',0,0),(4478,'Traduzir interface','pt-br',0,0),(4479,'Traduções de texto na interface do Drpual podem ser fornecidos por:','pt-br',0,0),(4480,'Traduzindo seu site, usando o módulo Locale integrado com <a href=\"translate\">interface de tradução</a>.','pt-br',0,0),(4481,'Importando arquivos de um conjunto existente de traduções, conhecido como pacote de traduções. Um pacote de traduções habilita a apresentação do Drupal em um idioma específico, e contém arquivos no formato Gettext Portable Object (<em>.po</em>). Embora nem todos idiomas estejam disponíveis para cada versão do Drupal, pacotes de traduções para muitos idiomas estão disponíveis para baixar na <a href=\"@translations\">Página de traduções do Drupal</a>.','pt-br',0,0),(4482,'Se um pacote de tradução existente não atende às suas necessidades, os arquivos Gettext Portable Object (<em>.po</em>) podem ser modificados, ou  novos arquivos <em>.po</em>podem ser criados utilizando um editor de Gettext. A ferramenta <a href=\'@import\'>importar</a> do módulo Locale permite que as expressões traduzidas de um arquivo <em>.po</em>, novo ou modificado, sejam adicionadas ao seu site. A ferramenta <a href=\'@export\'>exportar</a> do módulo Locale gera arquivos a partir de expressões traduzidas do seu site, que podem ser compartilhadas com outros ou editadas offline usando um editor Gettext.','pt-br',0,0),(4483,'Configurando um site multilíngua','pt-br',0,0),(4484,'Negociação de idiomas permite que seu site automaticamente altere o idioma baseado no domínio ou no caminho (URL) de cada requisição. Usuários podem (opcionalmente) selecionar o idioma preferido na página <em>Minha conta</em>, e seu site pode ser configurado para detectar a configuração de idioma preferido do navegador. O conteúdo do site pode ser traduzido usando o <a href=\"@content-help\">módulo Content translation</a>.','pt-br',0,0),(4485,'Determina o idioma para o parâmetro da requisição/sessão. Exemplo: \"http://example.com?language=de\" define o idioma para Alemão baseado no valor \"de\" do parâmetro \"language\".','pt-br',0,0),(4486,'Esta página permite a um tradutor buscar por certos textos traduzidos e não traduzidos, e é usada na hora de criar ou editar traduções. (Nota: Para trabalhos de tradução envolvendo muitos textos, pode ser mais conveniente <a href=\"@export\">exportar</a> os textos para edição offline em um aplicativo de edição de tradução Gettext.) Buscas podem ser limitadas a textos de um grupo de textos ou idioma específicos.','pt-br',0,0),(4487,'Administrar idiomas','pt-br',0,0),(4488,'Traduzir interface','pt-br',0,0),(4489,'Tradução','pt-br',0,0),(4490,'Regionalizar formatos de data','pt-br',0,0),(4491,'Redefinir os formatos de data.','pt-br',0,0),(4492,'Restaurar os formatos de data regionais para o padrão global','pt-br',0,0),(4493,'Janeiro','pt-br',0,0),(4494,'Fevereiro','pt-br',0,0),(4495,'Março','pt-br',0,0),(4496,'Abril','pt-br',0,0),(4497,'Maio','pt-br',0,0),(4498,'Junho','pt-br',0,0),(4499,'Julho','pt-br',0,0),(4500,'Agosto','pt-br',0,0),(4501,'Setembro','pt-br',0,0),(4502,'Novembro','pt-br',0,0),(4503,'Dezembro','pt-br',0,0),(4504,'adicionar link','pt-br',0,0),(4505,'Ainda não há links no menu. <a href=\"@link\">Adicionar link</a>.','pt-br',0,0),(4506,'O texto a ser usado para este link no menu.','pt-br',0,0),(4507,'O caminho pa