luído (itens definidos pelo sistema serão redefinidos).','pt-br',0,0),(4527,'<strong>Aviso:</strong> Atualmente existem @count itens de menu em %title. Eles serão excluídos (itens definidos pelo sistema serão redefinidos).','pt-br',4526,1),(4528,'Gerenciando menus','pt-br',0,0),(4529,'Usuários com a permissão <em>Administrar menus e itens de menu</em> podem adicionar, editar e apagar menus personalizados na <a href=\"@menu\">Página de administração de menus</a>. Menus personalizados podem ser menus especiais do site, menus de links externos, ou qualquer combinação de links internos e externos. Você pode criar um número ilimitado de menus adicionais, cada um deles terá um bloco associado para si. Selecionando <em>listar links</em>, você pode adicionar, editar ou apagar links de um determinado menu. A página de listagem de links fornece uma interface de arrastar-e-soltar para controlar a ordem dos links, e criar uma hierarquia no menu.','pt-br',0,0),(4530,'Exibindo menus','pt-br',0,0),(4531,'Após criar um menu, você deve habilitar e posicionar os blocos relacionados na <a href=\"@blocks\">Página de administração de blocos<a>.','pt-br',0,0),(4532,'Você pode habilitar o bloco recém criado para este menu na <a href=\"@blocks\">Página de administração de blocos</a>.','pt-br',0,0),(4533,'Cada menu tem um bloco correspondente que pode ser configurado na <a href=\"@blocks\">Página de administração de blocos</a>.','pt-br',0,0),(4534,'Administrar menus e itens de menu','pt-br',0,0),(4535,'Disponibilizar um link no menu','pt-br',0,0),(4536,'Links de menu com pesos menores são exibidos antes de links com pesos maiores.','pt-br',0,0),(4537,'Menus disponiveis','pt-br',0,0),(4538,'Os menus disponíveis para se colocar links deste tipo de conteúdo.','pt-br',0,0),(4539,'Item superior padrão','pt-br',0,0),(4540,'Escolha o item de menu que será o item superior para um novo link no formulário de criação de conteúdo.','pt-br',0,0),(4541,'Adicionar novos menus ao seu site, editar menus exi