e.','pt-br',0,0),(4561,'%type é usado em @count conteúdos do seu site. Se você removê-lo, você não conseguirá editar o conteúdo %type e ele pode não apresentar corretamente.','pt-br',4560,1),(4562,'Publicar conteúdo selecionado','pt-br',0,0),(4563,'Despublicar coteúdo selecionado','pt-br',0,0),(4564,'Promover conteúdo selecionado à página inicial','pt-br',0,0),(4565,'Remover o conteúdo selecionado da página inicial','pt-br',0,0),(4566,'Colocar o conteúdo selecionado no topo da página','pt-br',0,0),(4567,'Tirar o conteúdo selecionado do topo da página','pt-br',0,0),(4568,'Excluir conteúdo selecionado','pt-br',0,0),(4569,'@count posts excluídos.','pt-br',0,0),(4570,'Você tem certeza que quer apagar este item?','pt-br',0,0),(4571,'Você tem certeza que quer apagar estes itens?','pt-br',4570,1),(4572,'<em>Editar @type</em> @title','pt-br',0,0),(4573,'Você ainda não criou nenhum tipo de conteúdo. Vá para a <a href=\"@create-content\">página de criação de tipos de conteúdo</a> para adicionar um novo tipo de conteúdo.','pt-br',0,0),(4574,'Mensagem de registro de revisão','pt-br',0,0),(4575,'Deixe uma explicação das alterações que você está fazendo. Isto irá ajudar outros autores a entenderem suas motivações.','pt-br',0,0),(4576,'Tokens relacionados a itens de conteúdo individuais, ou \"nodes\".','pt-br',0,0),(4577,'O Id único do item, ou \"node\".','pt-br',0,0),(4578,'O corpo de texto principal do node.','pt-br',0,0),(4579,'O resumo do corpo de texto principal do node.','pt-br',0,0),(4580,'As permissões de acesso ao conteúdo precisam ser reconstruídas. <a href=\"@node_access_rebuild\">Reconstruir permissões</a>.','pt-br',0,0),(4581,'O módulo Node gerencia a criação, edição, exclusão, configurações e exibição do conteúdo principal do site. Itens de conteúdo gerenciados pelo módulo Node são comumente exibidos como páginas de seu site, e incluem um título, algumas informações de meta-data (autoria, data de criação, tipo de conteúdo, etc.), e campos opcionais contendo textos ou outros dados (campos são gerenciados pelo <a href=\"@modules\">módulo Field</a>). Para mais informações visite a página da documentação online referente ao <a href=\"@node\">módulo Node</a>.','pt-br',0,0),(4582,'Criando conteúdo','pt-br',0,0),(4583,'Quando um novo conteúdo é criado, o módulo Node grava informações básicas sobre o conteúdo, incluindo o autor, a data de criação, e o <a href=\"@content-type\">Tipo de conteúdo</a>. Ele também gerencia as <em>opções de publicação</em>, quando o conteúdo é publicado ou não, promovido para a página inicial do site, e/ou destacado no topo das listagens de conteúdo. Você pode definir uma configuração padrão para cada <a href=\"@content-type\">Tipo de conteúdo</a>.','pt-br',0,0),(4584,'Criando tipos de conteúdo personalizados','pt-br',0,0),(4585,'O módulo Node dá aos usuários com permissão de <em>Administrar tipos de conteúdo</em> a habilidade de <a href=\"@content-new\">criar novos tipos de conteúdo<a> além dos padrões pré-configurados. Criar tipos de conteúdo personalizados te dá flexibilidade para adicionar <a href=\"@field\">campos</a> e configurar padrões que se adaptam à diferentes necessidades de conteúdo do site.','pt-br',0,0),(4586,'Administrando conteúdo','pt-br',0,0),(4587,'A <a href=\"@content\">Página de administração de conteúdo</a> te permite revisar e gerenciar o conteúdo do seu site.','pt-br',0,0),(4588,'Criando revisões','pt-br',0,0),(4589,'O módulo Node também lhe permite criar múltiplas versões de qualquer conteúdo, e reverter para versões antigas usando as configurações de <em>Informação de revisão</em>.','pt-br',0,0),(4590,'Permissões de usuários','pt-br',0,0),(4591,'O módulo Node trás um número de permissões disponíveis para cada tipo de conteúdo, que podem ser atribuidos à papeis na <a href=\"@permissions\">página de permissões</a>.','pt-br',0,0),(4592,'Tipos de conteúdo individuais podem ter diferentes campos, comportamentos e permissões atribuidas à eles.','pt-br',0,0),(4593,'Itens do conteúdo podem ser exibidos usando diversos modos de visualização: Resumo, Conteúdo completo, Impressão, RSS, etc. <em>Resumo</em> é um formato curto normalmente usado em listas de múltiplos itens de conteúdo. <em>Conteúdo completo</em> é normalmente usado quando o conteúdo é exibido em sua própria página.','pt-br',0,0),(4594,'Aqui, você pode definir quais campos aparecem ou não quando um conteúdo do tipo %type é exibido em cada modo de visualização, e definir como os campos serão exibidos em cada modo de visualização.','pt-br',0,0),(4595,'Revisões lhe permitem acompanhar diferenças entre múltiplas versões do seu conteúdo, e reverter para versões mais antigas.','pt-br',0,0),(4596,'O conteúdo desta página foi modificado por outro usuário, ou você já enviou as modificações deste formulário. Por isso, suas alterações não puderam ser salvas.','pt-br',0,0),(4597,'Administrar tipos de conteúdo','pt-br',0,0),(4598,'Aviso: Dê apenas a papeis de confiança, esta permissão tem implicações de segurança.','pt-br',0,0),(4599,'Ver conteúdo publicado','pt-br',0,0),(4600,'Acessar a página de visão geral de conteúdo','pt-br',0,0),(4601,'Ignorar controle de acesso de conteúdo','pt-br',0,0),(4602,'Ver as revisões do conteúdo','pt-br',0,0),(4603,'Reverter versões do conteúdo','pt-br',0,0),(4604,'Excluir revisões de conteúdo','pt-br',0,0),(4605,'Ver o próprio conteúdo despublicado','pt-br',0,0),(4606,'Conteúdo destacado no topo das listas','pt-br',0,0),(4607,'Conteúdo promovido à página inicial','pt-br',0,0),(4608,'Número de itens de conteúdo recente a exibir','pt-br',0,0),(4609,'Exibir bloco para tipos de conteúdos específicos','pt-br',0,0),(4610,'Exibir este bloco apenas nas páginas que exibem conteúdo do(s) tipo(s) especificado(s). Caso não sejam selecionados tipos, não haverá limitação específica por tipo de conteúdo.','pt-br',0,0),(4611,'Bem-vindo ao @site-name','pt-br',0,0),(4612,'Nenhum conteúdo para a página inicial foi criado ainda.','pt-br',0,0),(4613,'O conteúdo será despublicado se ele conter qualquer uma das frases acima. Use uma lista de frases separadas por vírgula, sensíveis a maiúsculas e minúsculas. Exemplo: divertido, pular corda, \"Empresa, LTDA\"','pt-br',0,0),(4614,'Uma permissão em uso','pt-br',0,0),(4615,'@count permissões em uso','pt-br',4614,1),(4616,'Encontrar e gerenciar conteúdo.','pt-br',0,0),(4617,'Gerencia tipos de conteúdo, incluindo status padrão, promoção à página principal, opções de comentário, etc.','pt-br',0,0),(4618,'Editar tipo de conteúdo','pt-br',0,0),(4619,'Não exibir informações de postagem','pt-br',0,0),(4620,'Este site suporta <a href=\"@openid-net\">OpenID</a>, uma maneira segura de se logar em vários websites usando um único usuário e senha. OpenID reduz a necessidade de gerenciar muitos usuários e senhas para muitos websites.','pt-br',0,0),(4621,'Se você já possui um OpenID, digite a URL para seu servidor OpenID abaixo (ex. meuusuario.servidordeopenid.com). Da próxima vez em que você for se logar, você poderá usar esta URL ao invés dos usuário e senha tradicionais. Você pode ter múltiplos servidores de OpenID se quiser; basta adicioná-los aqui.','pt-br',0,0),(4622,'O módulo OpenID permite aos usuários se logarem usando o serviço de login único OpenID. <a href=\"@openid-net\">OpenID</a> é um método seguro para se logar em vários websites com apenas um usuário e senha. Ele não requer nenhum software especial, e não compartilha senhas com nenhum dos sites com o qual ele está associado, inclusive o site no qual está sendo feito o login. O maior benefício para os usuários é que eles podem tem uma única senha que eles podem usar em vários websites. Isso significa que eles podem atualizar facilmente sua única senha em um local centralizado, ao invés de ter que alterar várias senhas individualmente. Para mais informações, veja a página para o <a href=\"@handbook\">módulo OpenID</a> no manual online.','pt-br',0,0),(4623,'Entrando com OpenID','pt-br',0,0),(4624,'O usuário deve ter uma conta OpenID para efetuar login usando sua conta OpenID. Os usuários podem então, usando suas OpenIDs, criar contas no site, atribuir uma ou mais OpenIDs a uma conta registrada, e entrar usando uma OpenID. Isso diminui a barreira de entrada, ajudando a aumentar o número de usuários, e oferece segurança e conforto aos usuários. Já que OpenID não garante a legitimidade do usuário, a verificação por email ainda é necessária. Ao fazer login, o usuário vai ver uma opção de inserir o seu endereço de OpenID, no formato <em>usuario.servidoropenid.com</em>. A partir daí, o site comunica com o servidor OpenID, pedindo para verificar a identidade do usuário. Se o usuário está conectado ao servidor OpenID, o servidor responde o site confirmando o login do usuário. Se o usuário não estiver conectado, o servidor OpenIDvai solicitar a ele seu nome de usuário e senha.  Em nenhum momento o site aonde o usuário está se logando vai armazenar a senha OpenID dos usuários.','pt-br',0,0),(4625,'Após ter verificado seu endereço de e-mail, você poderá se logar por OpenID.','pt-br',0,0),(4626,'Desculpe, este não é um OpenID válido. Verifique se você digitou seu ID corretamente.','pt-br',0,0),(4627,'Complete o registro preenchendo o formulário abaixo. Se você já possui uma conta, pode fazer o <a href=\"@login\">login</a> agora e adicionar seu OpenID em \"Minha Conta\".','pt-br',0,0),(4628,'O registro da conta usando informações fornecidas pelo seu provedor OpenID falhou devido às razões listadas abaixo. Complete o registro preenchendo o formulário abaixo. Se você já tem uma conta, você pode <a href=\"@login\">acessar</a> agora e adicionar seu OpenID na página \"Minha conta\".','pt-br',0,0),(4629,'O módulo Overlay apresenta as páginas administrativas do seu site em uma caixa flutuante JavaScript na página que você estava visualizando, sem substituí-la na janela do navegador. Use o link fechar do flutuador para retornar para a página em que você estava antes. Para mais informações, veja a entrada do manual online do <a href=\"@overlay\">módulo Overlay</a>.','pt-br',0,0),(4630,'Acessar o overlay administrativo','pt-br',0,0),(4631,'Visualizar as páginas administrativas no overlay.','pt-br',0,0),(4632,'Apresenta a interface de administração do Drupal em uma janela flutuante.','pt-br',0,0),(4633,'Diálogo @title','pt-br',0,0),(4634,'Informe o caminho desejado para a URL alternativa. Por exemplo: node/28, forum/1, taxonomy/term/1','pt-br',0,0),(4635,'O módulo Path permite que você especifique URLs alternativas ou customizadas para qualquer caminho interno do sistema. URLs alternativas não devem ser confundias com redirecionamentos de URLs, os quais permitem o encaminhamento de uma URL inativa ou alterada para uma nova URL. Além de tornar URLs mais legíveis, URLs alternativas também ajudam a indexação mais efetiva do conteúdo por mecanismos de busca. Para automatizar a criação de caminhos alternativos você deve instalar o módulo contribuído <a href=\"@pathauto\">Pathauto</a>. Para mais informações veja a entrada  <a href=\"@path\">módulo Path</a> no manual online.','pt-br',0,0),(4636,'Criando URLs alternativas','pt-br',0,0),(4637,'Usuários com <a href=\"@permissions\">permissões</a> suficientes podem criar URLs alternativas na sessão <em>Definições de caminho URL</em> onde eles criam ou alteram conteúdo. Alguns exemplos de URLs alternativas são: ','pt-br',0,0),(4638,'<em>member/jane-smith</em> é uma URL alternativa para o caminho interno <em>user/13</em>','pt-br',0,0),(4639,'<em>about-us/team</em> é uma URL alternativa para o caminho interno <em>node/456</em>','pt-br',0,0),(4640,'Gerenciando URLs alternativas','pt-br',0,0),(4641,'O módulo Path provê uma forma de pesquisar e visualizar uma <a href=\"@aliases\">lista com todas as URLs alternativas</a> que existem no seu site. URLs alternativas podem ser adicionadas, editadas e removidas por esta lista.','pt-br',0,0),(4642,'Uma URL alternativa define um nome diferente para o caminho de uma URL existente - por exemplo, a URL alternativa \'sobre\' para o caminho \'node/1\'. A URL pode ter multiplas URLs alternativas.','pt-br',0,0),(4643,'Administrar URLs alternativas','pt-br',0,0),(4644,'Criar e editar URLs alternativas','pt-br',0,0),(4645,'A URL alternativa já está em uso.','pt-br',0,0),(4646,'Opcionalmente especifique uma URL alternativa pela qual este termo pode ser acessado. Use um caminho relativo e não adicione uma barra no final ou a URL alternativa não irá funcionar.','pt-br',0,0),(4647,'Ativando execução de código PHP em campos de texto','pt-br',0,0),(4648,'O módulo PHP Filter permite a usuários com as permissões adequadas incluirem código PHP personalizado que serão executados quando as páginas do seu site são processadas. Embora este seja um recurso poderoso e flexível quando usado por um usuário de confiança experiente em PHP, também é um risco de segurança significativo e perigoso nas mãos de usuários mal-intencionados ou inexperientes. Mesmo um usuário de confiança pode acidentalmente comprometer o site inserindo códigos PHP malformados ou incorretos. Apenas aos usuários mais confiáveis deve ser concedida a permissão para usar o filtro PHP, e todo o código PHP adicionado através do filtro PHP deve ser cuidadosamente examinado antes de utilizado. <a href=\"@php-snippets\">Exemplo de PHP snippets</a> podem ser encontrados em Drupal.org.','pt-br',0,0),(4649,'Usar PHP para configurações','pt-br',0,0),(4650,'<p>Adicione um bloco personalizado no seu site, chamado \"Bem-vindo\". Defina o formato de texto para \"Código PHP\" (ou outro formato que suporte PHP), e coloque o seguinte conteúdo no corpo:</p>\r\n<pre>\r\nprint t(\'Welcome visitor! Thank you for visiting.\');\r\n</pre>','pt-br',0,0),(4651,'<p>Em vez disso, para exibir o nome de um usuário registrado use:</p>\r\n<pre>\r\nglobal $user;\r\nif ($user->uid) {\r\n  print t(\'Welcome @name! Thank you for visiting.\', array(\'@name\' => format_username($user)));\r\n}\r\nelse {\r\n  print t(\'Welcome visitor! Thank you for visiting.\');\r\n}\r\n</pre>','pt-br',0,0),(4652,'O módulo PHP foi desativado. Eventuais conteúdos que estavam usando o filtro PHP agora serão visualizados em texto puro. Isto pode apresentar um risco de segurança expondo informações sensíveis, caso existam, usadas no código PHP.','pt-br',0,0),(4653,'O módulo Poll pode ser utilizado para criar enquetes simples ou questionários que mostram resultados cumulativos. Uma enquete é uma boa maneira de receber feedback de seus usuários e membros de comunidade. Para mais informações, visite a documentação online referente ao <a href=\"@poll\">módulo Poll</a>.','pt-br',0,0),(4654,'Criar uma enquete','pt-br',0,0),(4655,'Usuários podem criar uma nova enquete clicando em Enquete na página <a href=\"@add-content\">Adicionar conteúdo</a>, e preenchendo o formulário com a pergunta a ser feita, as possíveis respostas, e a quantidade de votos iniciais para cada uma das opções. O status (fechada ou ativa) e a duração (período de tempo que a enquete permanecerá ativa e receberá novos votos) também podem ser especificados.','pt-br',0,0),(4656,'Visualizando enquetes','pt-br',0,0),(4657,'Você pode visitar a página de <a href=\"@poll\">Enquetes</a> para ver as enquetes atuais, ou opcionalmente habilitar o bloco <em>Enquetes mais recentes</em> na <a href=\"@blocks\">Página de administração de blocos</a>. Para votar ou ver os resultados de uma enquete específica, você pode clicar na própria enquete.','pt-br',0,0),(4658,'Votar em enquetes','pt-br',0,0),(4659,'Cancelar e modificar os seus próprios votos','pt-br',0,0),(4660,'Seu voto foi cancelado.','pt-br',0,0),(4661,'Para permitir navegar neste campo pelo valor, informe o título da página resultante. A palavra <code>%value</code> será substituída pelo valor correspondente. Um exemplo de título:  \"Pessoas cuja cor favorita é %value\". Isto é apenas aplicável em campos públicos.','pt-br',0,0),(4662,'Para habilitar a navegação deste campo pelo valor, informe um título para a página resultante. Um título de exemplo é \"Pessoas que são funcionárias\". Aplicável apenas para campos públicos.','pt-br',0,0),(4663,'O módulo Profile permite administradores do site definirem campos personalizados (como o nome do país, nome completo, ou idade) para perfis de usuários, que são exibidos na seção <a href=\"@user\">Minha Conta</a>. Isto permite que usuários de um site compartilharem suas mais informações e pode ajudar a sites sociais organizarem os usuários em torno de informações específicas. Para mais informações, consulte no manual online o tópico <a href=\"@profile\">módulo Profile</a>','pt-br',0,0),(4664,'Adicionar campos ao perfil padrão','pt-br',0,0),(4665,'Para oferecer a possibilidade de usuários preencherem informações detalhadas sobre eles mesmos, o módulo Profile permite que campos adicionais sejam adicionados ao perfil padrão do usuário. Exemplos de informações comumente utilizadas são: <em>Localização</em>, <em>Empresa</em>, <em>Idade</em>, ou ainda <em>Sobre mim</em>.','pt-br',0,0),(4666,'Página de informações sobre usuário','pt-br',0,0),(4667,'O módulo Profile habilita links para maiores informações sobre os usuários do site. Você pode ver uma <a href=\"@profile\">Página de listagem de usuários</a>, e mais páginas específicas ao clicar nos links dos campos em qualquer profile. Por exemplo, a listagem <a href=\"@profile-country\">Pessoas que vivem no Canadá</a> no Drupal.org apresenta todos os usuários que informaram <em>Canadá</em> no campo <em>País</em> em seu perfil de usuário.','pt-br',0,0),(4668,'Bloco de informações do autor','pt-br',0,0),(4669,'O <em>Bloco de informações do autor</em> é um bloco padrão criado pelo módulo Profile que pode ser habilitado na <a href=\"@blocks\">Página de administração de blocos</a>. Ela apresenta aos visitantes do seu site informações do autor da página que eles estão lendo.','pt-br',0,0),(4670,'Esta página apresenta a lista dos campos personalizados de perfil de conta a ser apresentada na página <em>Minha conta</em>. Campos similares ou relacionados podem ser colocados dentro de uma categoria. Para adicionar uma nova categoria (ou editar uma existente), edite um campo de perfil e forneça uma categoria.','pt-br',0,0),(4671,'Enriquece seu conteúdo com metadados para permitir à outras aplicações (i.e. motores de busca, agregadores de RSS) melhor entendimento nos relacionamentos e atributos.','pt-br',0,0),(4672,'Os módulos de pesquisa ativos mudaram.','pt-br',0,0),(4673,'Você deve incluir pelo menos uma palavra-chave positiva com 1 caractere ou mais.','pt-br',0,0),(4674,'Você deve incluir pelo menos uma palavra-chave positiva com @count caracteres ou mais.','pt-br',4673,1),(4675,'Pesquisado %keys em %type','pt-br',0,0),(4676,'O módulo Search provê a habildade de indexar e pesquisar conteúdos por palavras exatas, e usuários por nome ou email. Para maiores detalhes, veja o manual online sobre o <a href=\"@search-module\">módulo Search</a>.','pt-br',0,0),(4677,'Pesquisa de conteúdo e usuários','pt-br',0,0),(4678,'Usuário com a permissão <em>Usar a pesquisa</em> pode usar o bloco de pesquisa e a <a href=\"@search\">Página de pesquisa</a>. Usuários com a permissão <em>Ver conteúdo publicado</em> pode pesquisar por conteúdo contendo palavras-chave exatas. Usuários com a permissão <em>Ver perfil dos usuários</em> podem pesquisar por usuários contendo a palavra-chave em qualquer lugar no nome do usuário, e usuários com a permissão <em>Administrar usuários</em> podem pesquisar pelo endereço de email. Adicionalmente, usuários com a permissão <em>Usar a pesquisa avançada</em> podem achar conteúdo através de pesquisas mais complexas usando o filtro da opção <em>Pesquisa avançada</em> na <a href=\"@search\">Página de pesquisa</a>.','pt-br',0,0),(4679,'Indexação de conteúdo com o cron','pt-br',0,0),(4680,'Editando configurações de busca','pt-br',0,0),(4681,'Comportamento de indexação pode ser ajustado usando a <a href=\"@searchsettings\">Página de configuração de pesquisa</a>. Usuários com a permissão <em>Administrar pesquisa</em> podem controlar opções como <em>Número de itens a indexar por execução do agendador de tarefas</em>, <em>Opções de indexação</em> (tamanho de palavras), <em>Módulos de pesquisa ativos</em>, e <em>Ranking do conteúdo</em>, que permite ajustar a prioridade com que conteúdos indexados retornam resultados.','pt-br',0,0),(4682,'O módulo Search inclui um bloco <em>Formulário de pesquisa</em> padrão, que pode ser habilitado e configurado na <a href=\"@blocks\">Página de administração de blocos</a>. O bloco está disponível para usuários com a permissão <em>Pesquisar conteúdo</em>.','pt-br',0,0),(4683,'Extendendo o módulo Search','pt-br',0,0),(4684,'Por padrão, nas buscas de conteúdo o módulo Search suporta apenas palavras-chave de correspondência exata. Você pode modificar esse comportamento através da instalação de um módulo de \"stemming\" de idioma específico (como por exemplo <a href=\"http://drupal.org/project/porterstemmer\"> Porter Stemmer</a> para inglês americano), que permite palavras tais como \"walk\", \"walking\", e \"walked\" serem encontradas pelo módulo Search. Outra abordagem é usar uma tecnologia de busca de terceiros com recursos \"stemming\" ou correspondência por palavra parcial, como <a href=\"http://drupal.org/project/apachesolr\">Apache Solr</a> ou <a href=\"http://drupal.org/project/sphinx\">Sphinx</a>. Estes e outros <a href=\"@contrib-search\">módulos da comunidade relacionados a busca</a> podem ser baixados acessando Drupal.org.','pt-br',0,0),(4685,'<ul>\r\n<li>Verifique se sua ortografia está correta.</li>\r\n<li>Remova as aspas em volta de frases para pesquisar por cada palavra individualmente. <em>bicicleta azul</em> pode muitas vezes mostrar mais resultados do que <em>&quot;bicicleta azul&quot;</em>.</li>\r\n<li>Considere usar <em>OR</em> na sua consulta.</li>\r\n<li><em>bicicleta OR azul</em> pode muitas vezes apresentar mais resultados que <em>bicicleta azul</em>.</li>\r\n<ul>','pt-br',0,0),(4686,'Administrar a pesquisa','pt-br',0,0),(4