ar atalho','pt-br',0,0),(4717,'Permite aos usuários gerenciar listas personalizadas de links de atalhos.','pt-br',0,0),(4718,'Valor @value é VERDADEIRO.','pt-br',0,0),(4719,'Valor @value é FALSO.','pt-br',0,0),(4720,'Valor @value é NULO.','pt-br',0,0),(4721,'Valor @value não é NULO.','pt-br',0,0),(4722,'Valor @first é igual ao valor @second.','pt-br',0,0),(4723,'Valor @first não é igual ao valor @second.','pt-br',0,0),(4724,'Valor @first é idêntico ao valor @second.','pt-br',0,0),(4725,'Valor @first não é idêntico ao valor @second.','pt-br',0,0),(4726,'O teste não foi concluído devido a um erro fatal.','pt-br',0,0),(4727,'Link com o rótulo %label encontrado.','pt-br',0,0),(4728,'Link com o rótulo %label não encontrado','pt-br',0,0),(4729,'Link contendo href %href encontrado.','pt-br',0,0),(4730,'Nenhum link contendo href %href encontrado.','pt-br',0,0),(4731,'Link %label (@url_target) clicado em @url_before','pt-br',0,0),(4732,'Opção @option para campo @id está selecionada.','pt-br',0,0),(4733,'Opção @option para campo @id não está selecionada.','pt-br',0,0),(4734,'Por padrão o SimpleText vai limpar os resultados após visualisados na página de resultados, mas em alguns casos pode ser útil deixar os resultados no banco de dados. Os resultados podem então ser vistos em <em>admin/config/development/testing/[test_id]</em>. O id do teste pode ser encontrado no banco de dados, tabela simpletest, ou observe ao observar os resultados pela primeira vez. Adicionalmente, alguns módulos podem fornecer mais análises ou recursos que precisam que esta opção esteja desligada.','pt-br',0,0),(4735,'Negociação GSS','pt-br',0,0),(4736,'NTLM','pt-br',0,0),(4737,'Qualquer método seguro','pt-br',0,0),(4738,'O módulo Testing fornece um framework para executar testes automatizados. Ele pode ser usado para verificar a saúde do Drupal antes e depois de alterações de código, ou uma forma de desenvolvedores escrever e executar testes para seus módulos. Para mais informações, veja esta entrada do manual online <a href=\"@simpletest\">módulo Testing</a>.','pt-br',0,0),(4739,'Executando testes','pt-br',0,0),(4740,'Visite a <a href=\"@admin-simpletest\">Página testing</a> para ver a lista de testes disponíveis. Para testes abrangentes, escolha <em>todos</em> os testes, ou selecione testes individualmente para resultados mais direcionados. Note que isto pode levar diversos minutos para que todos os testes completem. Para mais informações sobre criando e modificando seus próprios testes, veja a página do handbook <a href=\"@simpletest-api\">Documentação da Testing API</a>.','pt-br',0,0),(4741,'Conforme os testes rodarem, uma mensagem será exibida próxima a cada  grupo de testes indicando se passou, falhou, ou se ocorreram exceções. Passar significa que o teste retornou os resultados esperados, enquanto falhar significa que não. Uma exceção normalmente indica um erro fora do teste, como um aviso ou notificação do PHP. Se houveram falhas ou exceções, os resultados serão expandidos para mostrar detalhes e os testes que tiveram falhas ou exceções serão indicados pelas linhas rosas e vermelhas. Você poderá usar esses resultados para refinar seu código e testes até que todos passem com sucesso.','pt-br',0,0),(4742,'Administrar testes','pt-br',0,0),(4743,'O teste terminou em @elapsed.','pt-br',0,0),(4744,'Use o botão <em>Limpar ambiente</em> para excluir arquivos e tabelas temporárias.','pt-br',0,0),(4745,'O framework Testing requer que a restrição <a href=\"@open_basedir-url\">open_basedir</a> esteja desabilitada. Verifique a configuração do seu servidor web ou contate seu provedor de hospedagem.','pt-br',0,0),(4746,'O framework de testes não pôde ser instalado por que a biblioteca <a href=\"@curl_url\">cURL</a> do PHP não está disponível.','pt-br',0,0),(4747,'O framework de testes não pôde ser instalado por que a extensão <a href=\"@hash_url\">hash</a> do PHP está desativada.','pt-br',0,0),(4748,'Restrição PHP open_basedir','pt-br',0,0),(4749,'desbloquear endereço IP','pt-br',0,0),(4750,'bloquear endereço IP','pt-br',0,0),(4751,'O módulo Statistics exibe a frequência de visualizações de uma determinada página, quem a viu, a página anterior visitada pelo usuário (URL referente) e quando foi vista. Essas estatísticas são úteis para determinar como os usuários estão visitando e navegando pelo seu site. Para mais informações, consulte a seção do manual online para o <a href=\"@statistics\">módulo Statistics</a>.','pt-br',0,0),(4752,'Gerenciando registros','pt-br',0,0),(4753,'Para habilitar a coleta de estatísticas, você deve marcar a opção <em>Habilitar registro de acesso</em>. A opção <em>Descartar registros de acesso anteriores a</em>, na página de configurações, especifica por quanto tempo os registros serão mantidos antes de serem apagados. Para o descarte de registros antigos funcionar, o <a href=\"@cron\">agendador de tarefas</a> deve estar configurado corretamente.','pt-br',0,0),(4754,'Visualizando a utilização do site','pt-br',0,0),(4755,'O módulo Statistics pode ajudar a examinar os detalhes dos usuáriso e como eles estão usando o site. O módulo oferece 4 relatórios:','pt-br',0,0),(4756,'<a href=\"@recent-hits\">Acessos Recentes</a> exibe informações sobre a última atividade em seu site, incluindo o URL e título da página que foi acessada, o nome de usuário (se disponível) e o endereço IP do visitante.','pt-br',0,0),(4757,'<a href=\"@top-referrers\">Referências recorrentes</a> apresenta de onde os visitantes vieram (URL referente).','pt-br',0,0),(4758,'<a href=\"@top-pages\">Páginas mais acessadas</a> apresenta a lista de páginas ordenadas pela quantidade de visualizações.','pt-br',0,0),(4759,'<a href=\"@top-visitors\">Principais visitantes</a> exibe os usuários mais ativos do site e permite banir usuários abusivos.','pt-br',0,0),(4760,'Exibir conteúdo popular','pt-br',0,0),(4761,'O módulo inclui um bloco <em>Conteúdo popular</em> que exibe as páginas mais visitadas hoje, em todos os tempos, e também o último conteúdo visto. Para usar este bloco, habilite <em>Contar número de visitas ao conteúdo</em> na <a href=\"@statistics-settings\">página de configuração de estatísticas</a>, então você poderá habilitar e configurar o bloco na <a href=\"@blocks\">página de administração de blocos</a>.','pt-br',0,0),(4762,'Contador de visualizações de página','pt-br',0,0),(4763,'O módulo Statistics gera um contador de visitas para cada página. Para usar o contador, habilite <em>Contar número de visitas ao conteúdo</em> na <a href=\"@statistics-settings\">Página de configuração de estatísticas</a>, e garanta as <a href=\"@permissions\">permissões</a> necessárias (<em>Ver acessos ao conteúdo</em>) para que o contador seja visível a todos os usuários.','pt-br',0,0),(4764,'Administrar estatísticas','pt-br',0,0),(4765,'Ver estatísticas do conteúdo','pt-br',0,0),(4766,'Ver acessos ao conteúdo','pt-br',0,0),(4767,'Controla detalhes sobre o que e como seu site registra estatísticas de acesso.','pt-br',0,0),(4768,'O módulo Syslog registra eventos enviando mensagens para o logging facility do seu servidor de web. Syslog é uma ferramenta administrativa do sistema que fornece infromações valiosas para gerenciamento e auditoria de segurança do sistema. Syslog fornece ferramentas de filtragem que permitem o roteamento de mensagens por tipo e severidade, mais adequado para médios e grandes sites. Para mais informações veja a entrada <a href=\'@syslog\'>módulo Syslog</a> no manual online, e <a href=\'@php_openlog\'>openlog</a> e funções <a href=\'@php_syslog\'>syslog</a> em PHP.','pt-br',0,0),(4769,'Log para UNIX, Linux e Mac OS X','pt-br',0,0),(4770,'Em UNIX, Linux, e Mac OS X, o arquivo <em>/etc/syslog.conf</em> define a configuração de roteamento. Menssagens podem ser marcadas com códigos desde <code>LOG_LOCAL0</code> até <code>LOG_LOCAL7</code>. Para informações sobre Syslog, níveis de severidade, e como configurar o <em>syslog.conf</em>, veja a página do manual do <em>syslog.conf</em> em sua linha de comando