ntais do site. Várias operações chave para manutenção do sistema também são parte do módulo System. Para mais informações, consulte a página do manual online para o <a href=\"@system\">módulo System</a>.','pt-br',0,0),(4870,'Gerenciando módulos','pt-br',0,0),(4871,'O módulo System permite que um usuário com as devidas permissões habilite e desabilite módulos na <a href=\"@modules\">Página adminitração de módulos</a>. O Drupal vem com vários módulos no núcleo. Cada módulo oferece um conjunto distinto de características, devendo ser habilitado dependendo das necessidades do seu site. Uma grande variedade de módulos adicionais, contribuídos por membros da comunidade Drupal, podem ser baixados da <a href=\"@drupal-modules\">página de módulos do Drupal.org</a>.','pt-br',0,0),(4872,'Gerenciando temas','pt-br',0,0),(4873,'O módulo System permite que usuários com a permissão apropriada ativarem e desativarem temas na <a href=\"@themes\">página de administração de Temas</a>. Temas determinam a apresentação e design do seu site. O Drupal já vem com diversos temas, e temas adicionais estão disponíveis na <a href=\"@drupal-themes\">página de temas do Drupal.org</a>.','pt-br',0,0),(4874,'Gerenciamento de cache','pt-br',0,0),(4875,'O módulo System permite a usuários com as permissões apropriadas de gerenciar o cache na <a href=\"@cache-settings\">página de configuração de Performance<a>. O Drupal tem um sistema de cache robusto que permite eficiente reuso das páginas e seus componentes previamente construídos. Páginas requisitadas por usuário anonimo são armazenadas em um formato compactado; dependendo da configuração do site e no volume de tráfego ligado aos visitantes anônimos, o sistema de cache pode significaticamente aumentar a velocidade do seu site.','pt-br',0,0),(4876,'Executando manutenção do sistema','pt-br',0,0),(4877,'Definindo as configurações básicas do site','pt-br',0,0),(4878,'O módulo System também manipula opções básicas de configuração básica do seu site, incluindo <a href=\"@date-time-settings\">opções de Data e hora</a>, <a href=\"@file-system\">opções do sistema de Arquivos</a>, <a href=\"@clean-url\">suporte à URLs limpas</a>, <a href=\"@site-info\">Nome do site e outras informações</a>, e o <a href=\"@maintenance-mode\">modo de Manutenção</a> para colocar seu site temporariamente off-line.','pt-br',0,0),(4879,'Configurando ações','pt-br',0,0),(4880,'Ações são tarefas individuais que o sistema pode fazer, como despublicar um conteúdo ou banir um usuário. Módulos, como o <a href=\"@trigger-help\">módulo Trigger</a>, podem desencadear estas ações quando certos eventos acontecem, por exemplo, quando um novo post for adicionado ou quando um usuário faz login. Módulos também pode fornecer ações adicionais. Visite a página <a href=\"@actions\">Ações</a> para configurar as ações.','pt-br',0,0),(4881,'Instala e configura o tema padrão do seu site. <a href=\"@themes\">Temas</a> alternativos estão disponíveis.','pt-br',0,0),(4882,'Baixe <a href=\"@modules\">módulos adicionais</a> para estender as funcionalidades do Drupal.','pt-br',0,0),(4883,'Revise e instale as <a href=\"@updates\">atualizações disponíveis</a> para manter um site seguro e atual. Sempre rode o <a href=\"@update-php\">programa de atualização</a> toda vez que um módulo é atualizado.','pt-br',0,0),(4884,'Examine regularmente as <a href=\"@updates\">atualizações disponíveis</a> para manter um site seguro e atual. Sempre rode o <a href=\"@update-php\">script de atualização</a> quando um módulo é atualizado.','pt-br',0,0),(4885,'Examine regularmente as atualizações disponíveis para manter um site seguro e atual. Sempre rode o <a href=\"@update-php\">script de atualização</a> quando um módulo é atualizado. Ative o Gerenciador de atualizações para atualizar e instalar módulos e temas.','pt-br',0,0),(4886,'Se você estiver atualizando para uma nova versão do Drupal ou atualizando módulos ou temas contribuídos, você pode precisar executar o <a href=\"@update-php\">script de atualização</a>.','pt-br',0,0),(4887,'Existem dois tipos de ações: simples e avançada. Ações simples não exigem nenhuma configuração adicional e são listadas aqui automaticamente. Ações avançadas precisam ser criadas e configuradas antes de poderem ser usadas, pois elas têm opções que precisam ser especificadas; por exemplo, enviar um e-mail para um endereço específico, ou despublicar conteúdo contendo certas palavras. Para criar uma ação avançada, selecione uma ação da lista na seção de ações avançadas abaixo e clique no botão <em>Criar</em>.','pt-br',0,0),(4888,'Uma ação avançada oferece opções de configuração adicional que podem ser preenchidas abaixo. Alterar o campo <em>Descrição</em> é recomendado, de forma a melhor identificar a ação específica que está acontecendo. Esta descrição será apresentada em módulos como Trigger ao atribuir ações aos eventos de sistemas, então é melhor ser o mais descritivo possível (por exemplo, \"Envia email para a Equipe de Moderação\" é melhor do que apenas \"Envia email\").','pt-br',0,0),(4889,'Administrar módulos','pt-br',0,0),(4890,'Administrar configuração do site','pt-br',0,0),(4891,'Administrar temas','pt-br',0,0),(4892,'Administrar ações','pt-br',0,0),(4893,'Usar as paginas de administração e ajuda','pt-br',0,0),(4894,'Usar o site em modo de manutenção','pt-br',0,0),(4895,'Ver relatórios do site','pt-br',0,0),(4896,'Bloquear endereços de IP','pt-br',0,0),(4897,'Arquivos locais privados fornecido pelo Drupal','pt-br',0,0),(4898,'Atualizar módulos','pt-br',0,0),(4899,'Atualizar temas','pt-br',0,0),(4900,'SSH','pt-br',0,0),(4901,'Sua senha não é salva no banco de dados e é utilizada apenas para estabelecer uma conexão.','pt-br',0,0),(4902,'A conexão será criada entre o seu servidor web e o computador que hospeda os arquivos do servidor web. Na maioria dos casos, serão a mesma máquina, e \"localhost\" estará correto.','pt-br',0,0),(4903,'Configure o <a href=\"@user-edit\">fuso horário</a> da conta.','pt-br',0,0),(4904,'Sel