ost !host não está mais bloqueado porque não é um endereço IP válido.','pt-br',0,0),(4926,'Permissões para o papel !id inseridas em {role_permission}','pt-br',0,0),(4927,'O cacheamento agressivo foi desativado e substituído pelo cacheamento normal. Leia a seção sobre cache de página em default.settings.php para mais informações sobre como ativar uma funcionalidade similar.','pt-br',0,0),(4928,'%profile_name (%profile-%version)','pt-br',0,0),(4929,'A função phpinfo() foi desativada por motivos de segurança. Para ver as informações de phpinfo() do seu servidor, mude suas configurações PHP ou contate o administrador do servidor. Para mais informações, leia a página do manual sobre <a href=\"@phpinfo\">Ativando e desativando phpinfo()</a>.','pt-br',0,0),(4930,'Uma tentativa automática de criar esse diretório falhou, provavelmente devido a um problema de permissões. Para proceder com a instalação, crie o diretório e modifique suas permissões manualmente ou certifique-se de que o instalador tem as permissões para criá-lo automaticamente. Para mais informações, leia o arquivo INSTALL.txt ou o <a href=\"@handbook_url\">manual online</a>.','pt-br',0,0),(4931,'Sua configuração foi salva.','pt-br',0,0),(4932,'Nenhum vocabulário disponível. <a href=\"@link\">Adicionar novo vocabulário</a>.','pt-br',0,0),(4933,'Nenhum termo disponível. <a href=\"@link\">Adicionar novo termo</a>.','pt-br',0,0),(4934,'No momento, não existe nenhum conteúdo classificado com este termo.','pt-br',0,0),(4935,'Tokens relacionados a termos de taxonomia.','pt-br',0,0),(4936,'Tokens relacionados a vocabulários de taxonomia.','pt-br',0,0),(4937,'O módulo Taxonomy lhe permite classificar o conteúdo do seu website. Para classificar conteúdo, você define <em>vocabulários</em> que contém <em>termos</em> relacionados, e então atribui os vocabulários aos tipos de conteúdo. Para mais informações, veja a página para o <a href=\"@taxonomy\">módulo Taxonomy</a> no manual online.','pt-br',0,0),(4938,'Criando vocabulários','pt-br',0,0),(4939,'Usuários com <a href=\"@perm\">permissões</a> suficientes podem criar <em>vocabulários</em> e <em>termos</em> pela <a href=\"@taxo\">página de Taxonomias</a>. Essa página lista os termos e fornece uma interface de arrastar-e-soltar para controlar a ordem dos termos e sub-termos de um vocabulário, de forma hierárquica. Um <em>vocabulário</em> classificando música por gênero com termos e sub-termos poderia se parecer como segue:','pt-br',0,0),(4940,'<em>vocabulário</em>: Música','pt-br',0,0),(4941,'<em>termo</em>: Jazz','pt-br',0,0),(4942,'<em>sub-termo</em>: Swing','pt-br',0,0),(4943,'<em>sub-termo</em>: Fusion','pt-br',0,0),(4944,'<em>termo</em>: Rock','pt-br',0,0),(4945,'<em>sub-termo</em>: Country rock','pt-br',0,0),(4946,'<em>sub-termo</em>: Hard rock','pt-br',0,0),(4947,'Você pode relacionar um sub-termo à múltiplos termos pai. Por exemplo, <em>fusion</em> pode ser filho tanto de <em>rock</em> quanto de <em>jazz</em>.','pt-br',0,0),(4948,'Termos em um <em>vocabulário de termos livres</em> podem ser alimentados gradualmente no ato da criação ou edição do conteúdo. Este método é geralmente adotado em aplicações de gerenciamento de blogs ou fotos.','pt-br',0,0),(4949,'Atribuindo vocabulários para tipos de conteúdo','pt-br',0,0),(4950,'Se você quiser usar um novo vocabulário para classificar seu conteúdo, você deve criar um campo de \"Termo de taxonomia\" para o <a href=\"@ctedit\">tipo de conteúdo</a> na página de <em>Gerenciar campos</em>. Ao adicionar um campo desse tipo, você pode optar por um dos <em>widgets</em> para a entrada de informação de taxonomia na página de edição do conteúdo: lista de seleção, caixas de seleção, botões de opção, ou campo de texto com autocompletar (para criação de um vocabulário de tags livres). Após escolher o tipo de campo e widget, você poderá escolher na página seguinte,  <em>configurações de campo</em>, o vocabulário desejado, se apenas um ou múltiplos termos podem ser escolhidos, e outras configurações. O mesmo vocabulário pode ser adicionado a múltiplos tipos de conteúdo; para isso use a seção \"Adicionar campo existente\" na página de gerenciamento de campos.','pt-br',0,0),(4951,'Classificando conteúdo','pt-br',0,0),(4952,'Após atribuir o vocabulário a um tipo de conteúdo, você pode começar a classificar conteúdo. O campo contendo os termos aparecerá na tela de edição de conteúdo quando você editar ou <a href=\"@addnode\">adicionar conteúdo</a>.','pt-br',0,0),(4953,'Visualizando listas e feeds RSS pelo termo','pt-br',0,0),(4954,'Cada termo da taxonomia fornece uma página com uma lista de conteúdos que possuem a sua classificação, além de um feed RSS correspondente. Por exemplo, se o termo da taxonomia <em>rock clássico</em> possui o ID 123 (você pode constatar observando a URL ao passar o mouse sobre o link para o termo, que pode ser clicado para navegar direto para a página da lista), então você vai encontrar esta lista no endereço <em>taxonomy/123/feed</em> (O ícone RSS para a lista de conteúdos que contém esse termo será exibido automaticamente na barra de endereço do seu navegador quando esta página estiver sendo exibida).','pt-br',0,0),(4955,'Estender o módulo Taxonomy','pt-br',0,0),(4956,'Existem <a href=\"@taxcontrib\">muitos módulos contribuídos</a> que estendem a funcionalidade to módulo Taxonomy tanto para visualização quanto para organização dos termos.','pt-br',0,0),(4957,'A taxonomia é usada para categorizar conteúdo. Termos são agrupados dentro de vocabulários. Por exemplo, um vocabulário chamado \"Fruta\" pode conter os termos \"Maçã\" e \"Banana\".','pt-br',0,0),(4958,'Você pode reorganizar os termos em %capital_name usando seus ícones de arrastar e soltar, bem como agrupá-los sob um termo pai aos arrastá-los para baixo e para a direita do termo pai.','pt-br',0,0),(4959,'%capital_name contém termos agrupados dentro de um termo pai. Você pode reorganizar os termos em %capital_name usando seus ícones de arrastar e soltar.','pt-br',0,0),(4960,'%capital_name contém termos com múltiplos pais. Arrastar e soltar não é suportada para termos com múltiplos pais, mas você pode reabilitar o suporte a arrastar-e-soltar editando cada termo para incluir apenas um único pai.','pt-br',0,0),(4961,'Administrar vocabulários e termos','pt-br',0,0),(4962,'Editar termos em %vocabulary','pt-br',0,0),(4963,'Excluir termos de %vocabulary','pt-br',0,0),(4964,'O vocabulário que gera as opções para este campo.','pt-br',0,0),(4965,'O módulo Toolbar exibe, no topo da tela, links do primeiro nível do menu administração e também links de outros módulos. Para mais informações visite a documentação online do <a href=\"@toolbar\">módulo Toolbar</a>.','pt-br',0,0),(4966,'Mostrar links administrativos','pt-br',0,0),(4967,'Usar a barra de ferramentas da administração','pt-br',0,0),(4968,'Alternar a visibilidade da gaveta','pt-br',0,0),(4969,'Provê uma barra de ferramentas que mostra os principais itens de menu administrativos e links de outros módulos.','pt-br',0,0),(4970,'O módulo Tracker exibe os conteúdos mais recentemente modificados de seu site, e permite monitorar novos conteúdos criados por cada usuário. Este módulo não tem opções para configurar. Para mais informações, consulte o a seção do manual para o <a href=\"@tracker\">módulo Tracker</a>.','pt-br',0,0),(4971,'O módulo Tracker adiciona um novo item de menu ao menu Navegação, chamado <em>Conteúdo recente</em>. Você pode configurar itens de menu pela <a href=\"@menus\">Página de administração de menus</a>.','pt-br',0,0),(4972,'Monitorando conteúdos novos e atualizados do site','pt-br',0,0),(4973,'A página de <a href=\'@recente\'>Conteúdo recente</a> exibe conteúdos novos e atualizados em ordem cronológica reversa, listando tipo de conteúdo, título, nome do autor, número de comentários e data da última modificação. Um conteúdo é considerado atualizado quando ocorrem mudanças no texto, ou quando novos comentários são adicionados. A aba <em>Meu conteúdo recente</em> restringe a lista ao