tenham certas palavras. Para configurar uma combinação de gatilho/ações, visite a <a href=\"@actions-page\">Página de configuração de ações</a>, onde você pode verificar se a ação que você deseja já está disponível. Caso não esteja, crie uma nova ação <em>avançada</em>. Você precisará configurar uma ação avançada se houver opções de configuração, como por exemplo, especificar um endereço de email ou uma lista de palavras proibidas. Depois de configurar ou verificar sua ação, visite a <a href=\"@triggers-page\">Página de configuração de gatilhos</a> e escolha a aba adequada (Comentários, Taxonomia, etc), onde você pode atribuir a ação a ser executada quando o evento do gatilho ocorrer.','pt-br',0,0),(5000,'Ao salvar um novo conteúdo ou atualizar um conteúdo existente','pt-br',0,0),(5001,'Após salvar conteúdo atualizado','pt-br',0,0),(5002,'Ao salvar um novo comentário ou ao atualizar um comentário existente','pt-br',0,0),(5003,'Depois de criar uma nova conta de usuário','pt-br',0,0),(5004,'Depois de atualizar uma conta de usuário','pt-br',0,0),(5005,'Configurar quando executar ações.','pt-br',0,0),(5006,'Instalando atualizações','pt-br',0,0),(5007,'Preparando para atualizar o seu site','pt-br',0,0),(5008,'Instalando %project','pt-br',0,0),(5009,'Preparando para instalar','pt-br',0,0),(5010,'Erro instalando / atualizando','pt-br',0,0),(5011,'%project_name instalado com sucesso','pt-br',0,0),(5012,'A atualização foi concluída com êxito. Seu site foi tirado do modo de manutenção.','pt-br',0,0),(5013,'Atualização concluída com sucesso.','pt-br',0,0),(5014,'Atualização falhou! Veja o log abaixo para maiores informações.','pt-br',0,0),(5015,'Falha na atualização! Veja o log abaixo para mais informações. Seu site ainda está em modo de manutenção.','pt-br',0,0),(5016,'A instalação foi concluída com êxito. Seu site foi tirado do modo de manutenção.','pt-br',0,0),(5017,'A instalação foi concluída com sucesso.','pt-br',0,0),(5018,'Falha na instalação! Veja o registro abaixo par