ndo você define um campo, você escolhe um <em>tipo de campo</em> específico, que corresponde ao tipo de dados que deseja armazenar. O tipo de campo não pode ser alterado depois de criado o campo.','pt-br',0,0),(5271,'Como os dados serão inseridos e exibidos','pt-br',0,0),(5272,'Quantos valores o campo armazenará','pt-br',0,0),(5273,'Você pode gravar um valor, um número máximo de valores, ou optar por ilimitado. Por exemplo, a identificação numérica de um funcionário pode ser gravada em um único campo numérico, enquanto o número de telefone pode ter vários. Esta definição pode ser alterada após a criação do campo, mas se você reduzir o número máximo de valores, você pode perder informações.','pt-br',0,0),(5274,'Reutilizando os campos','pt-br',0,0),(5275,'Após você criar um campo, você pode reusá-lo. Por exemplo, se você criar um campo imagem para um tipo de conteúdo, e você precisa ter um campo imagem com os mesmos parâmetros em outro tipo de conteúdo, você pode adicionar o mesmo campo, na área <em>Adicionar campo existente</em> da interface de usuário. Você também pode adicionar o campo a um vocabulário de taxonomia, comentários, contas de usuários, etc.','pt-br',0,0),(5276,'Algumas configurações de um campo reutilizado são únicas de cada uso do campo; outras são compartilhadas por todos os lugares onde o campo é utilizado. Por exemplo, o rótulo de um campo de texto é único para cada uso, enquanto que a configuração do número de valores é compartilhada.','pt-br',0,0),(5277,'Há duas razões para reutilizar campos. Primeiro, reusar campos pode salvar seu tempo de ter de redefinir novos campos. Segundo, reutilizando campos também permite apresentar, filtrar, agrupar e ordenar conteúdo deste campo em vários tipos de conteúdos. Por exemplo, o módulo Views permite criar listas e tabelas de conte´duo. Então se você usar o mesmo campo em múltiplos tipos de conteúdo, você pode criar uma View contendo todos os tipos de conteúdos juntos apresentando esse campo, ordenado por ele, e/ou filtrando por esse campo.','pt-br',0,0),(5278,'Campos nos itens de conteúdo','pt-br',0,0),(5279,'Campos em conteúdo são definidos ao nível tipo-de-conteúdo, na guia <em>Gerenciar campos</em> da página de edição do tipo de conteúdo (que pode ser acessada a partir da <a href=\"@types\">página de tipos de conteúdo</a>). Quando você define um campo para um tipo de conteúdo, cada conteúdo daquele tipo terá este campo adicionado a ele. Alguns campos, como Título e Corpo, são disponibilizados a você quando tipos de conteúdo são criados pelo seu perfil de instalação.','pt-br',0,0),(5280,'Campos nos termos de taxonomia','pt-br',0,0),(5281,'Campos em termos de taxonomia são definidos ao nível vocabulário taxonomia, na guia <em>Gerenciar campos</em> da página de edição do vocabulário (que pode ser acessada a partir da <a href=\"@taxonomy\">página de Taxonomia</a>). Quando você define um campo para um vocabulário, cada termo neste vocabulário terá este campo adicionado a ele. Por exemplo, você poderia definir um campo de imagem a um vocabulário para armazenar um ícone para cada termo.','pt-br',0,0),(5282,'Campos nas contas de usuários','pt-br',0,0),(5283,'Campos de contas de usuários são definidos para todo o site na página <a href=\"@filelds\">Gerenciar campos</a>. Quando você define um campo para os usuários, cada conta de usuário terá o campo adicionado. Por exemplo, você poderia adicionar um campo de texto longo para permitir aos usuários incluir uma biografia.','pt-br',0,0),(5284,'Campos nos comentários','pt-br',0,0),(5285,'Campos em comentários são definidos ao nível tipo de conteúdo, na guia <em>Campos de comentários</em> da página de edição do tipo de conteúdo (que pode ser acessada a partir da <a href=\"@types\">página de tipos de conteúdo</a>). Quando você define um campo para comentários, cada comentário terá este campo adicionado a ele. Por exemplo, você poderia definir um campo website aos comentários em uma postagem de um fórum para permitir que usuários adicionem um link aos seus websites.','pt-br',0,0),(5286,'Administrar os formatos de texto e filtros','pt-br',0,0),(5287,'Adicionar novo %type','pt-br',0,0),(5288,'O novo conjunto é criado copiando os itens do seu conjunto de atalhos padrão.','pt-br',0,0),(5289,'O novo conjunto é criado copiando os itens do conjunto %default.','pt-br',0,0),(5290,'Você está usando o conjunto de atalhos %set-name.','pt-br',0,0),(5291,'editar nome do conjunto','pt-br',0,0),(5292,'apagar conjunto','pt-br',0,0),(5293,'Criar novo conjunto','pt-br',0,0),(5294,'O conjunto de atalhos %set_name foi criado. Você pode editá-lo desta página.','pt-br',0,0),(5295,'Atualizado o nome do conjunto para %set-name.','pt-br',0,0),(5296,'Se você escolheu este conjunto de atalhos como o padrão para alguns ou todos os usuários, eles também serão afetados se você apagá-lo.','pt-br',0,0),(5297,'Tem certeza que você quer apagar o conjunto de atalhos %title?','pt-br',0,0),(5298,'O conjunto de atalhos %title foi apagado.','pt-br',0,0),(5299,'1 usuário escolheu ou foi atribuído a este conjunto de atalhos.','pt-br',0,0),(5300,'@count usuários escolheram ou foram atribuídos a este conjunto de atalhos.','pt-br',5299,1),(5301,'O módulo Shortcut permite aos usuários criarem grupos de links de <em>atalhos</em> para as páginas mais visitadas do site. Atalhos estão contidos em <em>conjuntos</em>. Cada usuário com a permissão <em>Selecionar qualquer conjunto de atalhos</em> pode selecionar um conjunto de atalhos criado por qualquer usuário do site. Para mais informações, veja a página para o <a href=\"@shortcut\">módulo Shortcut</a> no manual online.','pt-br',0,0),(5302,'Administrando atalhos','pt-br',0,0),(5303,'Usuários com a permissão <em>Administrar atalhos</em> podem gerenciar conjuntos de atalhos e editar os atalhos nos conjuntos através da <a href=\"@shortcuts\">página de administração de atalhos</a>.','pt-br',0,0),(5304,'Escolher conjuntos de atalhos','pt-br',0,0),(5305,'Usuários com permissão para trocar conjuntos 