 dada a qualquer usuário que possa logar em seu site. Você pode tornar qualquer papel um papel de Administrador do site, ou seja, este papel terá automaticamente todas as permissões. Você pode fazer isso na página de <a href=\"@settings\">Configuração de usuários</a>. Você deve ter cuidado para garantir que somente usuários de confiança possuem esse acesso e nível de controle do seu site.','pt-br',0,0),(5344,'Os papéis dos usuários permitem que você controle com precisão a segurança e administração do Drupal. Um papel define um grupo de usuários com certos privilégios, definidos na página de <a href=\"@permissions\">permissões de usuário</a>. Por exemplo o papel de um usuário no site pode ser: usuário anônimo, usuário autenticado, moderador, administrador, etc. Nesta área você pode definir os nomes e ordem dos papéis dos usuários no seu site. É recomendada a ordenação de papéis de menor permissão (usuário anônimo) para o de maior permissão (administrador). Para apagar um papel, clique em \"editar papel\".','pt-br',0,0),(5345,'Use <em>artigos</em> para conteúdo temporal como notícias, comunicados de imprensa e posts de blog.','pt-br',0,0),(5346,'O arquivo selecionado %filename não pôde ser transferido. Somente arquivos com as seguintes extensões são permitidos: %extensions.','pt-br',0,0),(5347,'Bartik','pt-br',0,0),(5348,'Um tema flexível, com gerenciamento de cores e muitas regiões.','pt-br',0,0),(5349,'Plano de fundo principal','pt-br',0,0),(5350,'Plano de fundo das barras laterais','pt-br',0,0),(5351,'Bordas das barras laterais','pt-br',0,0),(5352,'Fundo do rodapé','pt-br',0,0),(5353,'Ameixa','pt-br',0,0),(5354,'Uma lista separada por espaço de tags HTML permitidas no conteúdo do feeditens. Tags não permitidas serão removidas do conteúdo.','pt-br',0,0),(5355,'%field pode conter apenas caracteres a-z, underscores ou hífens.','pt-br',0,0),(5356,'%field não pode conter markup.','pt-br',0,0),(5357,'Sem URLs alternativas disponíveis. <a href=\"@link\">Adicionar URL alternativa</a>.','pt-br',0,0),(5358,'Para fornecer pesquisa por palavras-chave, o mecanismo de busca mantém um índice das palavras encontradas no conteúdo e nos campos, assim como textos adicionados no seu conteúdo por outros módulos (como os comentários do módulo Comment, e termos de taxonomia do módulo Taxonomy). Para construir e manter o índice, uma configuração correta do <a href=\"@cron\">agendador de tarefas</a> é necessária. Usuários com a permissão <em>Administrar pesquisa</em> podem configurar as opções do cron na <a href=\"@searchsettings\">Página de opções de pesquisa</a>.','pt-br',0,0),(5359,'Reindexando conteúdo','pt-br',0,0),(5360,'Ações no site relacionadas ao conteúdo (criação, edição, ou apagar conteúdo e comentários) automaticamente marcam o conteúdo afetado para ser indexado ou reindexado na próxima vez que o agendador de tarefas for executado. Quando um conteúdo é marcado para reindexação o conteúdo anterior permanece no índice até que o agendador de tarefas seja executado, quando finalmente será substituído pelo novo conteúdo. Diferentemente das ações relacionadas a conteúdo,  ações relacionadas à estrutura do site não marcam o conteúdo afetado para reindexação. Exemplos de ações relacionadas à estrutura que afetam o conteúdo incluem apagar ou editar termos de taxonomia, habilitar ou desabilitar módulos que adicionam texto ao conteúdo (como Taxonomy, Content, e módulos que disponibilizam campos), e modificação de campos ou parâmetros de exibição dos seus tipos de conteúdo. Se você tomar uma destas ações e você quer se certificar de que o índice de busca está atualizado para refletir suas mudanças na estrutura do site, você pode marcar todo o conteúdo para reindexação clicando no botão \"Reindexar site\" na <a href=\"@searchsettings\">Página de configuração de busca</a>. Se você tem muito conteúdo em seu site, pode ser necessário várias execuções do agendador de tarefas para reindexar todo o conteúdo.','pt-br',0,0),(5361,'Essas opções controlam as 